INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a1ade1f3-6c89-4c62-884c-e45db3c11c7d', '2018-11-22 15:46:19.519', '2018-11-22 15:46:19.519', NULL, '79f122c9-bd4d-487a-bb2b-3ab154751020', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.7', NULL, 'Portable Document Format is a platform-independent format for representing formatted documents, developed by Adobe Systems Incorporated. It is the native format of Adobe’s Acrobat family of software products, version 1.7 corresponding to the release of Acrobat 8.0 and 9.0.  PDF is based on, and shares the same imaging model as, the PostScript page description language.  A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section.  PDF files can contain a wide variety of content, including text, images, video and audio.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8195465f-3d30-4973-bbb7-7ad5203e8a0a', '2018-11-22 15:46:22.46', '2018-11-22 15:46:22.46', NULL, 'ddb4e478-efa6-42a1-9590-93c2432ee719', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1a', NULL, 'The Portable Document Format/ Archive is a format designed for long term preservation by Adobe Systems. PDF/A is a simplified version of PDF 1.4, with all of the features from PDF 1.4 that would impede long term preservation removed. Removed features include Javascript, Audio/Visual content, LZW compression and encryption. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information.
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('649615f8-c9a4-465b-9cae-561f1eb22df8', '2018-11-22 15:46:25.752', '2018-11-22 15:46:25.752', NULL, '0c2b1d70-94fe-4ebf-84f9-2f02df9c0f9c', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1b', NULL, 'The Portable Document Format/ Archive is a format designed for long term preservation by Adobe Systems. PDF/A is a simplified version of PDF 1.4, with all of the features from PDF 1.4 that would impede long term preservation removed. Removed features include Javascript, Audio/Visual content, LZW compression and encryption. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information.
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('4b8ea7ca-73e5-49dd-9de9-3045bcec0b22', '2018-11-22 15:46:29.787', '2018-11-22 15:46:29.787', NULL, 'bd34c1c2-72d2-4300-910d-f63a554296f1', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2a', NULL, 'The Portable Document Format/Archive is a format designed for long term preservation by Adobe Systems. PDF/A is an ISO standardised version of PDF, with all of the features from PDF that would impede long term preservation removed. A major principle of PDF/A is that it is self contained and not reliant on externalities thus all font and colour information is encoded into the file. PDF/A files are larger than other types of PDF files due to the need for embedded information. PDF/A2 supports three levels of compliance: PDF/A-2a (Accessible), PDF/A-2b (Basic). and PDF/A-2u (Unicode). The PDF/A-2 standard is a constrained subset of ISO 32000-1 (PDF 1.7), which includes PDF 1.0-1.7 and is defined by ISO 19005-2:2011, which has the formal name ''Document management – Electronic document file format for long-term preservation – Part 2: Use of ISO 32000-1 (PDF/A-2)''.', NULL, NULL);
