INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('0a77bba0-16ad-42fe-a4db-f8abe996ca8e', '2018-11-22 15:46:49.693', '2018-11-22 15:46:49.693', NULL, '20e523ea-33e4-4e35-9aa3-adc811169dff', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'PDF/X was developed by the Committee for Graphics Arts Technologies Standards (CGATS) and Adobe. This  ''exchange standard'' format is based on Adobe''s PDF specification and includes additional notes specifically for delivery of high quality colour advertisements. A subset of the PDF specification, and an application standard as well as a file format standard; it was considered a ''more reliable'' PDF file. There are several versions of the standard, which address specific issues, PDF/X-1: 1999 was based on PDF 1.2, however there is no known implementation of this version. PDF/X-1 is the only PDF/X standard permitting encryption.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('68c3aef4-c4ac-47e2-af98-44b1315f47d8', '2018-11-22 15:46:52.171', '2018-11-22 15:46:52.171', NULL, '92452cec-a3f8-4ff2-8519-4ad5a9ef4ff8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This ''exchange standard'' format is based on Adobe''s PDF specification and a subset of the PDF specification. This version  was an updated version of PDF/X-1:1999, and was based on PDF 1.3. It was superseded in 2003 by PDF/X-1a and PDF/X-3, at which point it was recommended that PDF/X-1 no longer be used. PDF/X-1 is the only PDF/X standard permitting encryption.', NULL, NULL);
