INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('17b45a6b-8b91-4b9d-8432-c6cafbec881a', '2018-11-22 15:47:29.908', '2018-11-22 15:47:29.908', NULL, '255d714e-9368-49cb-b1b6-bb015bb7b934', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The Adaptive Multi-Rate (AMR or AMR-NB or GSM-AMR) audio codec is an audio compression format optimized for speech coding. AMR speech codec consists of a multi-rate narrowband speech codec that encodes narrowband (200–3400 Hz) signals at variable bit rates ranging from 4.75 to 12.2 kbit/s with toll quality speech starting at 7.4 kbit/s.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('4189a264-4b5e-43c0-b469-924ed2764a35', '2018-11-22 15:47:33.652', '2018-11-22 15:47:33.652', NULL, '38dbfd03-3baf-442d-8b1a-0ca2f72f9f53', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Adaptive Multi-Rate Wideband (AMR-WB) is a wideband speech audio coding standard based on Adaptive Multi-Rate encoding. AMR-WB provides a speech bandwidth of 50–7000 Hz compared to narrowband speech coders which in general offer around 300–3400 Hz. AMR-WB was developed by Nokia and VoiceAge.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('4a6c97f7-1446-4767-81a6-56a132ae36af', '2018-11-22 15:47:36.146', '2018-11-22 15:47:36.146', NULL, '431fdca6-41dd-493a-be45-77cc9860afac', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Additive Manufacturing File Format (AMF) is an open standard for describing objects for additive manufacturing processes such as 3D printing.', NULL, NULL);
