INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('9400844c-f8db-49ce-98f6-8d05fe35de4c', '2018-11-22 15:50:28.521', '2018-11-22 15:50:28.521', NULL, 'ec981544-1bc4-4c51-a9f8-b7647e75ee05', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Printer Font Binary (.pfb) is a type 1 font made by Adobe and other companies.They are encrypted and compressed and also allow for hints, which improve the appearance of text at 300 dpi and lower resolutions. With Adobe Type Manager, Type 1 fonts can also be used on non-PostScript printers. However, Mac OS X and Windows, starting with Windows 2000, natively support Type 1 fonts, and Adobe Type Manager is not required.
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('053508f7-e381-4861-9b83-d84749b46b61', '2018-11-22 15:50:31.443', '2018-11-22 15:50:31.443', NULL, '807d842b-edaf-47cf-8372-bb44b03e1810', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'An SWC file is a package of precompiled Flash symbols and ActionScript code. SWC files can be generated by the Adobe Flash Professional authoring tool, and by Flash Builder.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f06673bc-ded9-43d0-a425-374193bbdf90', '2018-11-22 15:50:33.325', '2018-11-22 15:50:33.325', NULL, '10c2c90d-b309-45e0-a3f6-dde573118095', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Adobe PostScript font used on the Macintosh platform (Mac OS 9.x and earlier); contains the outline data of the font, similar to a .pfb file in Windows; used in combination with a FOND resource file and bitmap data.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('843aac09-4666-4637-8d5b-1a350ee5d06e', '2018-11-22 15:50:36.095', '2018-11-22 15:50:36.095', NULL, 'b0f65b3e-e951-4d03-9bad-23f7e646a22e', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The Advanced Forensics Format (AFF) is an extensible open format for the storage of disk images and related forensic metadata. It was originally developed by Simson Garfinkel and Basis Technology.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('92256fe6-8d55-4ab5-a420-66e6bad2de79', '2018-11-22 15:50:38.818', '2018-11-22 15:50:38.818', NULL, '7d0065aa-76f8-4888-9ac5-40493e9b7007', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Advanced Function Presentation (AFP) is a presentation architecture and family of associated printer software and hardware that provides for document and information presentation independent of specific applications and devices.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('623773e0-4774-4431-90d8-7f7f98e08be3', '2018-11-22 15:51:57.272', '2018-11-22 15:51:57.272', NULL, '16670edf-37fd-4f56-b378-3136bb215873', '', NULL, NULL, NULL, NULL, 1, false, true, false, '6', NULL, 'AppleWorks was a productivity suite developed by the Apple subsidiary, Claris, that was originally called ClarisWorks and was renamed AppleWorks as of version 5.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('11bdeacc-2b0c-46a2-8c97-f15796b51de7', '2018-11-22 15:50:40.966', '2018-11-22 15:50:40.966', NULL, '99dcfb2a-973c-49cd-87a9-2b04f2e25aa3', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The Advanced Systems Format is an extensible file format developed by Microsoft for storing multimedia data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. ASF files can contain audio, video and still image data streams, and the format supports streaming across networks. ASF supports a variety of audio, video and still image compression types, although it is most widely used for storing Windows Media Audio and Video encoded data.', '2004-11-01 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6bd8309f-188b-4405-a3f7-99442407d4eb', '2018-11-22 15:50:42.646', '2018-11-22 15:50:42.646', NULL, '2380e084-61e7-492e-bad6-138a5b29221e', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'ADX is a proprietary audio storage and compression format developed by CRI Middleware. PRONOM currently holds one PUID for all known version numbers, with separate identification signatures for each.', NULL, NULL);
