INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('7d6d346a-61df-442c-98a2-c44af9cfc5b4', '2018-11-22 15:51:18.993', '2018-11-22 15:51:18.993', NULL, '1b933609-b587-4534-9298-9a77f97b423d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'Apple’s Core Audio Format is a file format for storing and manipulating digital audio data. It is fully supported by Core Audio APIs on Mac OS X v10.4 and later and on Mac OS X v10.3 with QuickTime 7 or later. CAF provides high performance and flexibility, and is scalable to future ultra-high resolution audio recording, editing, and playback. CAF files have several advantages over other standard audio file formats:
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('55695d10-0e65-4c7a-9fe4-7212b2bacee6', '2018-11-22 15:51:20.858', '2018-11-22 15:51:20.858', NULL, '66d2c122-b5d9-4a21-b2ab-3243565a4f11', '', NULL, NULL, NULL, NULL, 1, false, true, false, '4.2', NULL, 'Disk Copy 4.2 (DC42) is the common name used to refer to disk images of floppy disks created by the 4.2 version of Disk Copy provided by the Mac Operating System.', NULL, NULL);
