INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8dea4348-9809-4f25-b583-b55501548f9a', '2018-11-22 15:52:33.084', '2018-11-22 15:52:33.084', NULL, '04d337db-707b-47c5-bdf8-8937aa037999', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.2', NULL, 'The Audio Interchange File Format (Audio IFF) provides a standard for storing sampled sounds. The format allows for the storage of monaural or multichannel sampled sounds at a variety of sample rates and sample widths. Audio IFF conforms to the " EA IFF 85" Standard for Interchange Format Files developed by Electronic Arts. Audio IFF is primarily an interchange format, although application designers should find it flexible enough to use as a data storage format as well. If an application does choose to use a different storage format, it should be able to convert to and from the format defined in this document. This will facilitate the sharing of sound data between applications. Audio IFF is the result of several meetings held with music developers over a period of ten months in 1987-88.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('cfc599a7-3efd-4007-8b01-e56da6269671', '2018-11-22 15:52:35.102', '2018-11-22 15:52:35.102', NULL, 'c2cfcc71-49ce-40bb-b057-e8d4915ba14f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.3', NULL, 'The Audio Interchange File Format (Audio IFF) was developed by Apple Computer, Inc., and provides a standard for storing sampled sounds. The format allows for the storage of monaural or multichannel sampled sounds at a variety of sample rates and sample widths.  Audio IFF was designed to serve primarily as an interchange format. Audio IFF conforms to the "EA IFF 85" Standard for Interchange Format Files developed by Electronic Arts. The audio data in a standard AIFF file is uncompressed pulse-code modulation (PCM). There is also a compressed variant of AIFF known as AIFF-C or AIFC, with various defined compression codecs. File specifications available at http://www-mmsp.ece.mcgill.ca/documents/audioformats/aiff/Docs/AIFF-1.3.pdf
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a9b098b3-a624-403c-b9ab-9ab7ead28fc9', '2018-11-22 15:52:36.655', '2018-11-22 15:52:36.655', NULL, '84659942-5edf-4e91-8a08-2d79ca19b53d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The Audio Interchange File Format, Compressed (AIFF-C) provides a standard for storing uncompressed or compressed sampled sounds.  The format can store monaural or multichannel sampled sounds in a range of sample rates and sample widths.  The format is extensible to handle new compression types and application-specific data.', '1991-08-26 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('bf889126-a5c9-4304-b706-054c4f4944cd', '2018-11-22 15:56:57.907', '2018-11-22 15:56:57.907', NULL, 'b0675326-1dad-4ac5-99ee-f2d51d5a4fad', '', NULL, NULL, NULL, NULL, 1, false, true, false, 'ASCII', NULL, 'TrueSpace was a commercial 3D computer graphics and animation software originally developed by Caligari Corporation before being acquired by Microsoft. The .scn extension indicates a scene, the .cob extension indicates an object.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d30eec4c-7170-46dc-a278-ba03abf085b0', '2018-11-22 15:52:38.165', '2018-11-22 15:52:38.165', NULL, '447f0363-3d73-481b-a3d8-af6ada79947d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Audio/Video Interleaved Format (AVI) is a chunk-based video format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, an AVI file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with an AVI data type identifier, followed by a series of chunks. Every file must include two List chunks. The first List chunk is the main AVI header chunk, which contain one or more Stream Header chunks, one for each data stream, describing the format of the data streams. The second LIST chunk is the ‘movi’ chunk, which contains the actual data for the audio and video data streams. Other optional chunks are also allowed. The format supports a wide variety of compressed and uncompressed video encodings, but all audio streams are stored in Microsoft’s Waveform Audio format.', NULL, NULL);
