INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('0f8513e4-25fe-478a-8fd3-e92a0d460613', '2018-11-22 15:53:18.495', '2018-11-22 15:53:18.495', NULL, '6be4b845-498a-4df6-b192-9c07171fe265', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.1', NULL, 'The AutoCAD Drawing format is a vector graphics format, and is the native file format of AutoDesk''s AutoCAD family of products. The format is proprietary and AutoDesk does not make details of its structure public. The information contained here is derived primarily from the OpenDWG Alliance''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. The basic structure of a DWG file comprises a header section, a drawing class definitions section, the drawing object data, a drawing object map, which contains the locations of all the objects in the drawing, and an image data section, which may contain a raster image of the drawing in either Windows Bitmap (BMP) or Windows Metafile (WMF) format. DWG version 2.1 is the version of the format associated with Version 2.1 of AutoCAD.', '1985-05-01 00:00:00', NULL);
