INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('077acdc8-c06e-426a-9e70-b64e8b9bfd99', '2018-11-22 15:53:05.116', '2018-11-22 15:53:05.116', NULL, '63471aa2-e52c-4b73-a0ce-415ec0207da6', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'DWFx is the newest version of the AutoCAD Design Web Format (DWF). DWFx is based on the XML Paper Specification (XPS). DWF and DWFx are  compressed file formats which can be suitable for distributing over the Internet for review. You can export a single drawing or publish multiple drawings and sheet sets into a DWF or DWFx file.', NULL, NULL);
