INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8b00a12b-4c25-4d2d-91bd-b96a66bdac42', '2018-11-22 15:54:15.522', '2018-11-22 15:54:15.522', NULL, '83177b67-7e75-4d4e-aa41-c076c4677351', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'AutoCAD slide files are screen images. A slide file consists of a header portion and one or more data records of variable length. Data records follow the header. Each data record begins with a field whose high-order byte is the record type. If a slide contains any vectors at all, a New colour record will be the first data record. The order of the vectors in a slide, and the order of the endpoints of those vectors, may vary.
