INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('79be89d3-d706-4648-b284-79a658bbbe5c', '2018-11-22 15:54:37.82', '2018-11-22 15:54:37.82', NULL, 'b9004dcc-787f-46b5-abe8-5df4d84cafa1', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'AutoShade was an early 3D rendering package for use with AutoCAD. AutoShade wrote the rendering to an .RND file as a 2D vector image.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8ea2ee00-f3bc-46b8-ba0e-9b8b6a2be5e5', '2018-11-22 15:54:39.32', '2018-11-22 15:54:39.32', NULL, '02ed8ac4-733e-46e9-b1a4-f545a38295d1', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c72fcefe-7f81-423b-9027-e38d9785b628', '2018-11-22 15:54:40.804', '2018-11-22 15:54:40.804', NULL, '92e08ea3-c357-4538-a479-21afc4bd1d10', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Clip Information File may be created by some AVCHD video recorders and contains metadata describing the AVCHD stream.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6bea693a-fb28-4237-9545-b479c4cad2a1', '2018-11-22 15:54:44.311', '2018-11-22 15:54:44.311', NULL, 'b5a31d5f-d666-4984-ab56-d4e943b0d363', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Index file manages the relationships between other AVCHD files.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('80df2496-49ac-40a8-82e0-e08c7a62873a', '2018-11-22 15:54:46.297', '2018-11-22 15:54:46.297', NULL, 'fd08c898-6cb2-487b-a9a5-1ad3cfe8f153', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Movie Object file manages the play order of playlists.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d9b4df35-e9c0-40e4-b878-edc3d300793b', '2018-11-22 15:54:48.357', '2018-11-22 15:54:48.357', NULL, 'ba521cdf-46de-4e21-88a5-7d282258407b', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Playlist File may be created by some AVCHD video recorders and contains an ordered list of references to associated AVCHD streams.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('50897ae4-3988-4be8-a2af-6b38fefe228a', '2018-11-22 15:54:50.63', '2018-11-22 15:54:50.63', NULL, 'b3d0c921-4bd8-46d5-bac4-13a408010fbd', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'AVCHD (Advanced Video Coding High Definition) is a file-based format for the digital recording and playback of high-definition video. The Thumbnail Index file stores an index to AVCHD thumbails, which are JPEG files with a .tdt extension.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('e8d45520-23fd-41e6-9b5e-1dc6650a171f', '2018-11-22 15:54:52.396', '2018-11-22 15:54:52.396', NULL, '1fa6547d-746b-4c7a-9237-eab67810a361', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.x', NULL, 'AWD is a binary file format for 3D scenes, objects and related data, and is intended for exchange between any conforming AWD exporter and a conforming parser. Its main use is with the Away3D engine, a 3D engine designed for ActionScript 3 and the Adobe Flash Platform.', NULL, NULL);
