INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('fc4dc6c8-f237-4f84-9934-7d8b41853f1f', '2018-11-22 15:55:42.233', '2018-11-22 15:55:42.233', NULL, '2a5350eb-7bc3-4c68-9c9c-f94a89737118', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8421fcbb-f2e7-48a6-81cf-cc5eeb60cc76', '2018-11-22 15:55:44.142', '2018-11-22 15:55:44.142', NULL, 'b2133c97-7c32-4bba-8cce-f1f57e1ede77', '', NULL, NULL, NULL, NULL, 1, false, true, false, 'LRF', NULL, 'Broad Band eBook (BBeB) is a proprietary e-book format created by Sony and Canon for Sony e-book readers. The LRF variant is a compiled, unencrypted version of an LRS file. Sony discontinued development of BBeB in 2010, in favour of the EPUB format.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('cbf69809-df9d-49a6-9418-e1b9fc35665b', '2018-11-22 15:55:47.894', '2018-11-22 15:55:47.894', NULL, 'f8930dfa-ea96-4005-a6a4-2ebc85412a9d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '0 Generic', NULL, 'Broadcast WAVE is a chunk-based audio format developed by the European Broadcasting Union, and based on the Microsoft WAVE format, which is in turn based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, a BWAVE file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It comprises a RIFF header with a WAVE data type identifier, followed by a series of chunks. Every file must include a Broadcast Audio Extension chunk, containing metadata required for exchange of information between broadcasters, a Format chunk, which describes the format of the audio data, and a Data chunk, containing the audio data itself. BWAVE files which contain MPEG-encoded audio data must also include a Fact chunk, containing file-dependent information about the audio data, and an MPEG Audio Extension chunk, containing extra information required to describe the MPEG encoding.  A BWAVE identified as generic by DROID likely uses an encoding format unknown to PRONOM, or perhaps a structural difference, and users are encouraged to let the PRONOM team know should this occur.', '1997-01-01 00:00:00', '2001-07-01 00:00:00');
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('3a881139-2c17-4654-9f82-68e5ebc00131', '2018-11-22 15:56:45.393', '2018-11-22 15:56:45.393', NULL, '7ded57a7-14dc-45b1-bd24-da859218419e', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.', NULL, NULL);
