INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8045a311-ad01-492a-b962-27948629f5a8', '2018-11-22 16:00:37.149', '2018-11-22 16:00:37.149', NULL, 'a7685794-9352-4177-b3c5-af8d93ef86c3', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Cypher is a declarative graph query language for the open source graph database, Neo4j. Although it has regular and well defined syntax, there are no magic numbers or header sequences. As such, there is no current means to identify a file as CQL by binary sequence alone, so identification of this format is by extension only.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ae8a0985-d270-402d-b2eb-1dc86e1ec70a', '2018-11-22 16:00:39.061', '2018-11-22 16:00:39.061', NULL, 'd2fc1cef-c50c-491d-b9fa-d4f80eff7bee', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Dalvik is the process virtual machine in Google''s Android operating system, which executes applications written for Android. Programs are commonly written in Java and compiled to bytecode for the Java virtual machine, which is then translated to Dalvik bytecode and stored in .dex (Dalvik EXecutable) and .odex (Optimized Dalvik EXecutable) files.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c100062b-ed42-4e58-bd99-563ca86c9996', '2018-11-22 16:00:41.442', '2018-11-22 16:00:41.442', NULL, 'b60471ce-980c-4997-b0f0-770a47acfad9', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Data Interchange Format (.dif) is a text file format used to import/export single spreadsheets between spreadsheet programs (OpenOffice.org Calc, Excel, Gnumeric, StarCalc, Lotus 1-2-3, FileMaker, dBase, Framework, Multiplan, etc.). It is also known as Navy DIF. One limitation is that DIF format cannot handle multiple spreadsheets in a single workbook.', NULL, NULL);
