INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('bea32842-2f9f-43a5-90ae-363732cf8b66', '2018-11-22 16:01:53.587', '2018-11-22 16:01:53.587', NULL, 'a9f70c6d-e068-4618-abd0-a540476e98a9', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The DirectMusic Segment is a file format created by Microsoft. The files can be played with DirectMusic API using a Microsoft Software Synthesizer or any installed MIDI output device. DirectMusic provides DLS support, and SGT files often accompany sound banks. SGT files contain playing order and track information. Segment files always come with DirectMusic Style files, which contain all required melody pattern information.', NULL, NULL);
