INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('10bb5573-7dcd-403b-a157-cd6343c3fc9e', '2018-11-22 16:02:20.743', '2018-11-22 16:02:20.743', NULL, '3eb4753a-cf5f-4c43-bb71-8fb6c6d328e0', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'The Drawing Interchange Binary Format (DXB) is a vector graphics format developed by AutoDesk for its AutoCAD family of products. A DXB file comprises a file header followed by zero or more data records. Each data record begins with a single byte identifying the record type, followed by one or more data items. The DXB format should not be confused with the binary encoded version of the Drawing Interchange File Format (DXF) - DXB is an entirely separate format, being much simpler and more compact.', '1990-10-01 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a7bff64d-4818-4392-8116-27fe32017432', '2018-11-22 16:02:22.566', '2018-11-22 16:02:22.566', NULL, 'f74cdb3a-b606-4fa0-949c-4860f3a9bcff', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'ASCII DXF format is the ASCII encoded variant of the Drawing Interchange File Format, an exchange format for vector graphics developed by AutoDesk. They are probably the widely-used formats for exchanging vector data, and have become a de-facto industry standard. The format is owned by AutoDesk and typically changes with each release of their AutoCAD family of products. DXF files contain a tagged representation of the vector data. The structure comprises a Header section, followed by sections containing data on Classes, Tables, Blocks, Entities and, optionally, thumbnail images. Each section contains a series of data elements. each preceded by a group code tag, which indicates the type of data element. ASCII DXF version 1.0 is the version of the format associated with Version 1.0 of the AutoCAD family of software products.', '1982-12-01 00:00:00', NULL);
