INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('7f2a7538-21a5-46f4-a803-08e08e66b5d8', '2018-11-22 16:02:51.701', '2018-11-22 16:02:51.701', NULL, '2db083d1-795f-4557-a528-0a0e35de93af', '', NULL, NULL, NULL, NULL, 1, false, true, false, 'Generic', NULL, 'ASCII DXF format is the ASCII encoded variant of the Drawing Interchange File Format, an exchange format for vector graphics developed by AutoDesk. They are probably the widely-used formats for exchanging vector data, and have become a de-facto industry standard. The format is owned by AutoDesk and typically changes with each release of their AutoCAD family of products. DXF files contain a tagged representation of the vector data. The structure comprises a Header section, followed by sections containing data on Classes, Tables, Blocks, Entities and, optionally, thumbnail images. Each section contains a series of data elements. each preceded by a group code tag, which indicates the type of data element. It is not mandatory for ASCII DXF files to include a version identifier - some DXF files may therefore be identifiable only as generic DXF.', NULL, NULL);
