INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('dc318715-ccae-4939-abc8-982f62285f71', '2018-11-22 16:03:23.896', '2018-11-22 16:03:23.896', NULL, 'ba6ab096-a402-45d4-bdd5-d131ed697ebd', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'The DROID File Collection File format is a format for storing the results of file format identifications generated by the DROID software tool. It was developed by The National Archives of the UK. A DROID File Collection File is an XML document, comprising a ''FileCollection'' element, which describes the version of DROID and Signature File version number used to perform the identifications number, and date on which the identifications were generated. This element contains a ''File'' element for each file being identified. A File Collection File may either be generated prior to identification, in which case each ''File'' element simply contains the fully-qualified pathname of the file, or it can be generated after identification, in which case each ''File'' element additionally contains the identification result.', '2005-09-17 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('717db7b0-b7e1-4d50-bb83-0c7d9f0949fa', '2018-11-22 16:08:30.454', '2018-11-22 16:08:30.454', NULL, '35c55388-b63f-4c2d-8ceb-b367f8dedadb', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1-4', NULL, 'HDF is a data model, library, and file format for storing and managing data.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('bb0339e5-dcc4-409d-9104-2de10eef10f2', '2018-11-22 16:03:26.83', '2018-11-22 16:03:26.83', NULL, 'a3c8c4af-a372-43b6-9680-abdb78f26343', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'The DROID Signature File format is a format for storing internal and external signatures used by the DROID software tool to perform automatic file format identification. It was developed by The National Archives of the UK. DROID Signature Files are generated by TNA from the PRONOM technical registry, and are issued periodically as new formats are added to the registry. A DROID Signature File is an XML document, comprising an ''FFSignatureFile'' element, which describes the version number and date of the signature file, an ''InternalSignatureCollection'' element, which contains the set of internal signature values, and a ''FileFormatCollection'' element, which contains information on the set of formats described, together with their associated external signatures. The version number of a Signature File is incremented each time a new signature file is issued from the PRONOM registry, and does not indicate a different version of the format itself.', '2005-09-17 00:00:00', NULL);
