INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c3d6c6b3-e87d-4166-b9cb-f0550c911068', '2018-11-22 16:03:46.197', '2018-11-22 16:03:46.197', NULL, '2a58f755-4eae-4d65-9eb3-d7b0fad9c37a', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.2', NULL, 'Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 1.2, the first version of the format, was developed in 1987. An EPS file comprises a header section followed by a PostScript document. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.', '1987-03-12 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('55efa097-019c-4632-97df-90f7a83f0bc4', '2018-11-22 16:03:48.842', '2018-11-22 16:03:48.842', NULL, '5cc0f0d6-e46f-4499-989e-a00d5f5e64e8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.0', NULL, 'Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 2.0, the second version of the format, was developed in 1989. An EPS file comprises a header section followed by a PostScript document. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.', '1989-01-16 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('3d66b485-8a1a-444f-8148-bda2a4fe9d86', '2018-11-22 16:03:50.692', '2018-11-22 16:03:50.692', NULL, '1c868d9c-62da-4435-b1d1-a75283ad2199', '', NULL, NULL, NULL, NULL, 1, false, true, false, '3', NULL, 'Encapsulated Postscript (EPS) is a page description format, developed by Adobe Systems Incorporated. Version 3, the third version of the format, was developed in 1992, and subsequently revised in 1999 to include a number of extensions and features of the PostScript language not previously documented. An EPS file comprises a header section followed by a PostScript document. The header can refer to version 3.0 or version 3.1. An EPS can optionally include a preview raster image, in which case a binary header is prepended to the header.', '1992-05-01 00:00:00', NULL);
