INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('1f0a23d4-db05-431f-b899-0e51f205cd52', '2018-11-22 16:04:19.195', '2018-11-22 16:04:19.195', NULL, '12473051-2b5e-43db-8f69-9df937295c4d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'An Arc/Info binary grid is a proprietary raster GIS file format developed by ESRI. The grid defines geographic space as an array of equally sized square grid points arranged in rows and columns. Each grid point stores a numeric value that represents a geographic attribute such as elevation or surface slope. Each grid cell is referenced by its x,y coordinate.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d526d90c-2175-4a3d-94a7-924b42cf3f42', '2018-11-22 16:04:21.353', '2018-11-22 16:04:21.353', NULL, 'b1db3634-d2be-480f-83e1-f70fac56226f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'ESRI ArcInfo Export File Format (also known as ArcInfo Interchange File Format) is a vector file format which is produced by ESRI and pre-dates the shapefile. It is as an export file used to enable coverage, grid or TIN and an associated INFO table to be transferred between different machines, which are not connected by any type of file sharing network. A volume has the extension .E00 through .E99.
