INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('fb2d3eea-1eeb-4012-aba0-317b31a83ef0', '2018-11-22 16:04:48.991', '2018-11-22 16:04:48.991', NULL, '60844d8c-c65e-4ff3-a5af-c7250923c861', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'A world file is a plain text computer data file used by geographic information systems to georeference raster map images, which may be produced in several of the basic image formats. The file specification was introduced by Esri. World files establish an image-to-world transformation that converts the image coordinates in raster data to real-world coordinates, where each cell in the image has a row and column number.  Some image formats will store their georeferencing information in a separate file, rather than in the header. World Files do not specify a coordinate system, but contain six-line files that provide the georeferencing information. Furthe information can be found at http://webhelp.esri.com/arcgiSDEsktop/9.3/index.cfm?TopicName=World_files_for_raster_datasets and http://webhelp.esri.com/arcims/9.2/general/topics/author_world_files.htm', NULL, NULL);
