INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6689fe04-c706-49d4-93fe-13e8f2ed5a0a', '2018-11-22 16:05:14', '2018-11-22 16:05:14', NULL, '392bd2a2-700b-43de-b57d-17a293026bad', '', NULL, NULL, NULL, NULL, 1, false, true, false, '32bit Big Endian', NULL, 'The Executable and Linkable Format (ELF) was developed by Unix System Laboratories and is the standard binary format for executables, object code, shared libraries and core dumps in Unix and Unix-like systems running x86 architecture. Generally within Unix and Unix-like systems, ELF files generally do not have a format extension, however some ELF files may be found with a .elf or .o extension.', NULL, NULL);
