INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('00570b49-d47f-4abc-b4e8-416275a6fdfe', '2018-11-22 16:05:26.1', '2018-11-22 16:05:26.1', NULL, '2eee1270-3251-4655-9ae4-01475fd4d3d6', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'The Extensible Hypertext Markup Language (XHTML) is a reformulation of the Hypertext Markup Language (HTML) as an application of the Extensible Markup Language (XML). This allows for the automated processing of XHTML documents using a standard XML parser. XHTML 1.0 represents the reformulation of HTML 4.01 in XML. The structure and grammar of an XHTML document is defined using a Document Type Definition (DTD). An XHTML document consists of nested elements, each of which may have attributes and content. It begins with an XHTML Document Type declaration, defining the XHTML version and Document Type Definition (DTD) to which it conforms. XHTML documents are typically encoded in UTF-8 or UTF-16.', '2000-01-26 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f2c31977-aea5-42fa-8ac7-a27de893236a', '2018-11-22 16:05:27.847', '2018-11-22 16:05:27.847', NULL, '3bdcbf4a-13ac-4b0c-a7bf-9e049bbf57e8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.1', NULL, 'The Extensible Hypertext Markup Language (XHTML) is a reformulation of the Hypertext Markup Language (HTML) as an application of the Extensible Markup Language (XML). This allows for the automated processing of XHTML documents using a standard XML parser. XHTML 1.1 is now recommended by the W3C over HTML for the creation of web pages. The structure and grammar of an XHTML document is defined using a Document Type Definition (DTD). An XHTML document consists of nested elements, each of which may have attributes and content. It begins with an XHTML Document Type declaration, defining the XHTML version and Document Type Definition (DTD) to which it conforms. XHTML documents are typically encoded in UTF-8 or UTF-16.', '2001-05-31 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('926489a6-2334-49da-9be6-1fe4133dda9f', '2018-11-22 16:05:30.256', '2018-11-22 16:05:30.256', NULL, '9c05277b-21f5-446d-8e17-21fddad13e4f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'The Extensible Markup Language (XML) is a general purpose markup language for creating other, special purpose, markup languages, and is a simplified subset of SGML. The structure and grammar of an XML document can be defined using a markup declaration, such as a Document Type Definition (DTD) or XML schema. A XML document consists of nested elements, each of which may have attributes and content. It typically begins with an XML declaration, defining the XML version and character set used. This may be followed by a Document Type declaration, containing or pointing to a markup declaration for the class of document. An XML document is said to be well-formed if it conforms to the XML specification; it is said to be valid if it additionally complies with a defined markup declaration. The formatting and transformation of XML documents can be controlled using the Extensible Stylesheet Language (XSL).', '2004-02-04 00:00:00', NULL);
