INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8a692f97-3465-4814-afd1-3c0f353b70ce', '2018-11-22 16:07:59.967', '2018-11-22 16:07:59.967', NULL, '83316c2c-0d52-4b19-80c9-f9148bc58070', '', NULL, NULL, NULL, NULL, 1, false, true, false, '89a', NULL, 'The Graphics Interchange Format (GIF) is a raster image format developed by Compuserve, primarily for use on the internet. A GIF file begins with a Header section and a Logical Screen Descriptor section. This is followed by one or more Image sections, and the file is terminated by a Trailer. GIF supports bit depths between 1 and 8 bits (i.e. up to 256 colours) and supports features such as interlacing and transparency. Images are always stored using lossless LZW compression. GIF 89a introduced a number of new features, including a series of optional Control Extensions, which can be used to control the rendering of images within a file.', '1990-07-31 00:00:00', NULL);
