INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('2b3b7774-75a1-4d35-bf32-d4f59dc4d91e', '2018-11-22 16:08:56.833', '2018-11-22 16:08:56.833', NULL, '7e471086-74ad-42cc-b0f1-41374d58c76c', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.0', NULL, 'The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 2.0 represents the first formal specification of the language.', '1995-11-01 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('b0e9e7c3-ba67-40df-b761-b3486e93f766', '2018-11-22 16:08:58.735', '2018-11-22 16:08:58.735', NULL, 'db1bbadd-4dd0-49ab-96a0-96a6ca751e1d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '3.2', NULL, 'The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 3.2 was the first major revision to the original HTML 2.0 specification.', '1997-01-14 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('1d369054-e09b-4f03-aaea-055152e99ff3', '2018-11-22 16:09:00.776', '2018-11-22 16:09:00.776', NULL, '1cb7dd1d-473a-46cc-9357-390bd704382a', '', NULL, NULL, NULL, NULL, 1, false, true, false, '4.0', NULL, 'The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration, defining the HTML version and Document Type Definition (DTD) to which it conforms. HTML 4.0 represents a major revision of the HTML 3.2 specification.', '1998-04-24 00:00:00', NULL);
