INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('999346fa-9767-4433-a7f1-c436f37756af', '2018-11-22 16:09:03.904', '2018-11-22 16:09:03.904', NULL, 'eab49647-562d-4d95-ba1e-bf7452c4943e', '', NULL, NULL, NULL, NULL, 1, false, true, false, '5', NULL, 'The HyperText Markup Language (HTML) is a markup language designed for the rendering of information via a web browser. It was originally defined as a highly simplified subset of SGML, but is now an international standard, and is maintained by the World Wide Web Consortium (W3C). A HTML document consists of nested elements, each of which may have attributes and content. It begins with an HTML Document Type declaration. HTML 5 does not explicitly define the HTML version or any Document Type Definition (DTD) within the DOCTYPE tag.', NULL, NULL);
