INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('718da4ad-010e-4236-be6c-d8a17752c985', '2018-11-22 16:09:22.655', '2018-11-22 16:09:22.655', NULL, '420ea335-0790-4d57-91b1-80519495faf6', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Associated with Apple video editing software application ''iMovie''. This format is based on an XML property list.', NULL, NULL);
