INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('1bb43cc0-70d7-4f3c-b791-8099c22c70f1', '2018-11-22 16:09:32.408', '2018-11-22 16:09:32.408', NULL, '8b77b3ee-dac2-4e57-a2ca-c9a7c7db3c6a', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2x3', NULL, 'The Industry Foundation Classes (IFC) data model is intended to describe building and construction industry data. It is a platform neutral, open file format specification that is not controlled by a single vendor or group of vendors. It is an object-based file format with a data model developed by buildingSMART (formerly the International Alliance for Interoperability, IAI) to facilitate interoperability in the architecture, engineering and construction (AEC) industry, and is a commonly used collaboration format in Building information modeling (BIM) based projects.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('b4bb8681-5dd6-4bad-89a5-0352c48a9a33', '2018-11-22 16:09:34.403', '2018-11-22 16:09:34.403', NULL, '34c02a38-c6cb-4d2e-8dda-0daa2a137014', '', NULL, NULL, NULL, NULL, 1, false, true, false, '4', NULL, 'The Industry Foundation Classes (IFC) data model is intended to describe building and construction industry data. It is a platform neutral, open file format specification that is not controlled by a single vendor or group of vendors. It is an object-based file format with a data model developed by buildingSMART (formerly the International Alliance for Interoperability, IAI) to facilitate interoperability in the architecture, engineering and construction (AEC) industry, and is a commonly used collaboration format in Building information modeling (BIM) based projects.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5ad51f94-6e67-4e3a-be55-5447c79a78e5', '2018-11-22 16:26:33.004', '2018-11-22 16:26:33.004', NULL, 'd7cfd6c3-30f8-4c7c-9fec-adb16b25e35d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2', NULL, 'Nrrd is a library and file format designed to support scientific visualization and image processing involving N-dimensional raster data. Version 2 added key/value pairs.', NULL, NULL);
