INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6b0360db-0ffb-4a92-b08e-5a871155d155', '2018-11-22 16:10:47.166', '2018-11-22 16:10:47.166', NULL, '40d7e49a-06c1-4c5b-865e-bd93ae2c5cf0', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Jeff''s Image Format (JIF) is a raster image file format that was designed to be a patent-free alternative to GIF. It is nearly identical to GIF, except that it uses zlib compression instead of LZW.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('9af0d22f-df65-4542-b292-0ba662523ac3', '2018-11-22 16:10:49.053', '2018-11-22 16:10:49.053', NULL, 'a198d5cd-f771-4f7d-be18-67959367aa24', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Nuclear magnetic resonance spectroscopy (NMR spectroscopy) data files produced by with JEOL''s NMR Spectrometers.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5a07ef49-0049-4022-b6fb-cd43b670677f', '2018-11-22 16:10:51.171', '2018-11-22 16:10:51.171', NULL, '4bb61014-c77b-422e-9b3f-7002d7371ab7', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The JPEG 2000 file format (JP2 file format) provides a foundation for storing application specific data (metadata) in association with a JPEG 2000 codestream, such as information which is required to display the image.  The JP2 file format encapsulates the JPEG 2000 codestream along with other core pieces of information about that codestream.  The building-block of the JP2 file format is called a box; all information contained within the format is contained in boxes.  There are several different box types; some boxes contain other boxes.  The binary structure of a file is a contiguous sequence of boxes.  The start of the first box is the first byte of the file, and the last byte of the last box is the last byte of the file.', '2004-09-15 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d26b1a46-ffe6-432d-8699-c8ec9351d70f', '2018-11-22 16:10:53.436', '2018-11-22 16:10:53.436', NULL, '281bf185-03bf-4e8d-9b0d-1a18d6b6f969', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JPEG XR (abbr. For JPEG extended range) is a still-image compression standard and file format for continuous tone photographic images, based on technology originally developed and patented by Microsoft under the name HD Photo (formerly Windows Media Photo). It supports both lossy and lossless compression.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c134104b-d6ed-432b-8b2f-75f3eaadd48d', '2018-11-22 16:10:55.393', '2018-11-22 16:10:55.393', NULL, 'd7bc5844-8927-4290-9877-c70ef61a93f3', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.00', NULL, 'The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard; this is what is commonly referred to as the JPEG file format. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Start of Image (SOI) marker, immediately followed by a JFIF Application (APP0). This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f1e2f714-7036-47df-9263-ce55bf53ebeb', '2018-11-22 16:10:57.233', '2018-11-22 16:10:57.233', NULL, 'bc6f10cd-d51b-492f-8055-00f7772bd802', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.01', NULL, 'The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard; this is what is commonly referred to as the JPEG file format. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Start of Image (SOI) marker, immediately followed by a JFIF Application (APP0). This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6e492f16-1b23-407c-b10b-bc9fe1ed5506', '2018-11-22 16:10:59.377', '2018-11-22 16:10:59.377', NULL, '173d3c4d-f6cd-4dc3-80f9-6ccaa1e9b279', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.02', NULL, 'The JPEG File Interchange Format (JFIF) is a file format for storing JPEG-compressed raster images. It was developed by the Independent JPEG Group and C-Cube Microsystems, in the absence of any such format being defined in the JPEG standard, and rapidly became a de facto standard. A JFIF file comprises a JPEG data stream together with a JFIF marker. It begins with a Start of Image (SOI) marker, immediately followed by a JFIF Application (APP0) marker and one or more optional application extension markers. This is followed by the JPEG image data, which is terminated by an End of Image (EOI) marker. JFIF supports up to 24-bit colour and uses lossy compression (based on the Discrete Cosine Transform algorithm). Other types of compression are available through JPEG extensions, including progressive image buildup, arithmetic encoding, variable quantization, selective refinement, image tiling, and lossless compression, but these may not be supported by all JFIF readers and writers.', '1992-09-01 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a0129461-2558-4ae2-8de3-91ef2959da24', '2018-11-22 16:16:50.635', '2018-11-22 16:16:50.635', NULL, 'dec1eba0-1c22-4e92-87fe-14b6baad9f5f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1', NULL, 'Microsoft Network Monitor is a packet analyser used to examine and interpret network traffic.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('0f2a5c10-865b-4c78-8081-19028bcc3944', '2018-11-22 16:11:01.036', '2018-11-22 16:11:01.036', NULL, '69ed73dc-5749-4f60-852b-a447951069b5', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JPEG Network Graphics (JNG) is a JPEG-based graphics file format which is closely related to PNG: it uses the PNG file structure (with a different signature) as a container format to wrap JPEG encoded image data. JNG was created as an adjunct to the MNG animation format, but may be used as a stand-alone format. JNG files embed an 8-bit or 12-bit JPEG datastream in order to store color data, and may embed another datastream (1, 2, 4, 8, 16 bit PNG, or 8 bit JPEG grayscale image) for transparency information. However, a JNG may contain two separate JPEG datastreams for color information (one eight-bit and one twelve-bit) to permit decoders that are unable to (or do not wish to) handle twelve-bit datastreams to display the eight-bit datastream instead, if one is present.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('14af7739-5afa-4705-944e-8af10993b11d', '2018-11-22 16:11:02.508', '2018-11-22 16:11:02.508', NULL, 'bf28dd63-ae25-4a78-9aa4-4b56f4badd1e', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'A standard for lossless or near-lossless compression of images, also known as ISO/IEC 14495-1 and ITU Recommendation T.87, created by the Joint Photographics Experts Group (JPEG). It was developed as a low complexity lossless image compression standard in 1999, and was based on LOCO-I algorithm. JPEG-LS also provides a lossy mode. It has faster compression than JPEG 2000 and is considered better than the original lossless JPEG standard.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ae969eee-991c-406d-82e0-fbcea423caa8', '2018-11-22 16:11:04.539', '2018-11-22 16:11:04.539', NULL, 'bad77f41-2a8e-4a9c-9108-e6144eebbfe4', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The JPEG 2000 Compound Image File Format is an optional file format for storing compound images using the JPEG 2000 file format family architecture. A compound image is an image that may contain scanned images, synthetic images or both, and that preferably requires a mix of continuous tone and bi-level compression methods.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6abaacb5-5b1b-47c1-99a2-b17b58e3c5c6', '2018-11-22 16:11:06.5', '2018-11-22 16:11:06.5', NULL, 'b2832eef-c675-4a79-8eba-fea79d04cbaa', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JPX is an image file format extended from JP2, providing the potential for extended colour space support, alternative compression methods, and other features. JPX may be used in applications that require additional functionality or data structures beyond those defined in the JP2 file format.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('0142f9f0-be9f-4667-87ef-811a015f1977', '2018-11-22 16:11:08.639', '2018-11-22 16:11:08.639', NULL, '406deafd-ebe0-4bb8-834b-38a3859ad9a5', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JavaScript Object Notation (JSON) is an open standard format that uses human-readable text to transmit data objects consisting of attribute–value pairs. It is used for asynchronous browser/server communication (AJAJ). While it is originally derived from JavaScript scripting language, JSON is language independent while using conventions that match with the C-family of languages, including C, C++, C#, Java, JavaScript, Perl, Python, and others.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('471f264b-61aa-4bb3-9960-03f22b255b0a', '2018-11-22 16:11:10.994', '2018-11-22 16:11:10.994', NULL, '5d3333b0-735e-45eb-b99d-883ed6c81ca1', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JSON-LD is a JSON-based format to serialize Linked Data. It is designed to be easy to convert an existing JSON file to JSON-LD. It''s main objective is to be a way to use Linked Data in Web-based programming environments, to build interoperable Web services, and to store Linked Data in JSON-based storage engines.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6abdcb96-256a-425e-ac93-36fccc630664', '2018-11-22 16:11:12.717', '2018-11-22 16:11:12.717', NULL, '080d6d99-e40a-4c69-96be-0832b76d1aed', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JTIP is a multi-resolution format, created for image presentation with easy transfer and handling, based on SPIFF. It allows presentation of images in various sizes and resolutions from vignette (1/16 screen size, used for browsing) through imagette (1/4 screen, for image comparison), to full screen and higher resolution images. Each layer is divided into tiles so the user can zoom or pan easily. A file contains an internal ID for tiles, with each tile associated with a single file header and separated by markers. Under header there can be and optional table noting the tile offsets, or an external ID for separate files. JTIP is not widely used and is no longer supported.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('3dabe67e-da3c-437f-8c82-9f4a5b782169', '2018-11-22 16:11:14.513', '2018-11-22 16:11:14.513', NULL, '85412bcd-731c-4348-990b-c9271d64a598', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Notebook documents are files which are produced by the Jupyter Notebook application, they consist of Python computer code as well as rich text elements. They are both human readable documents as well as executable.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('357b7deb-4f08-466f-a6e3-ba57cc8c35a0', '2018-11-22 16:11:16.517', '2018-11-22 16:11:16.517', NULL, 'fd940f5b-74e3-4cb4-b7e6-e60a37e537a2', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JustWrite is a word processer which was developed by the Symantec Corporation in the 1990''s.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('3915edc0-797b-4b2c-9a1e-5349dca18be9', '2018-11-22 16:11:17.954', '2018-11-22 16:11:17.954', NULL, '19b57067-87ca-4208-8978-dbc8a92dca57', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'KML is an Open Geospatial Consortium (OGC) sponsored xml schema file format used to display geographic data in an earth browser, such as Google Earth, Google Maps, and Google Maps for mobile. A KML file is processed in much the same way that HTML (and XML) files are processed by web browsers. Like HTML, KML has a tag-based structure with names and attributes used for specific display purposes. Thus, Google Earth and Maps act as browsers for KML files.
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('75b34f82-5572-47e9-95ec-f2561e1d70f1', '2018-11-22 16:11:19.481', '2018-11-22 16:11:19.481', NULL, '82dabf1e-ef56-4208-9ba0-a1860e0709cd', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'KML is an Open Geospatial Consortium (OGC) sponsored xml schema file format used to display geographic data in an earth browser, such as Google Earth, Google Maps, and Google Maps for mobile. A KML file is processed in much the same way that HTML (and XML) files are processed by web browsers. Like HTML, KML has a tag-based structure with names and attributes used for specific display purposes. Thus, Google Earth and Maps act as browsers for KML files.
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c045eb76-51be-4483-92ac-ed8e7568859f', '2018-11-22 16:11:21.158', '2018-11-22 16:11:21.158', NULL, 'b79d5ef3-d61e-49d9-bdb8-7b2345911d40', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'KTX (Khronos Texture) is a file format for storing OpenGL textures.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('90abe1a7-6627-429f-aa64-832ec7d133f8', '2018-11-22 16:11:23.043', '2018-11-22 16:11:23.043', NULL, '25698479-bb38-4fd5-915d-0132f3636d22', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Kodak DCR is the raw image generated by some models of Kodak DCS camera. The format is based upon the Tagged Image File Format.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f73e2939-4995-4ce1-9b8c-2738979fb342', '2018-11-22 16:11:25.063', '2018-11-22 16:11:25.063', NULL, 'b0cbe9b0-2c5b-427a-b1b7-9879aac92288', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The FlashPix format is a raster based image format that builds on features of previous formats, including Kodak Image Pac, Live Picture IVUE, Hewlett-Packard JPEG, TIFF, and TIFF/EP. The FlashPix format is a cooperative endeavor that includes the Eastman Kodak Company, Microsoft Corporation, the Hewlett-Packard Company, and Live Picture, Inc.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5c42e4b9-79de-4a49-91c4-90a8ad20aee1', '2018-11-22 16:11:27.301', '2018-11-22 16:11:27.301', NULL, '349a1376-3be9-414f-ab02-6444d5e30637', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.', NULL, NULL);
