INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ea978f5f-da2c-4733-98fc-580ef312747b', '2018-11-22 16:11:30.745', '2018-11-22 16:11:30.745', NULL, '16855f08-9a27-44ef-8aef-6d71a343bd01', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Krita is a free raster graphics editor. Krita''s native document format is Krita Document (.kra), which is loosely based on the Open Document standard. The format is used for handling layered raster based graphics.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('389bb2ba-461d-473a-b0fb-e04da3116e91', '2018-11-22 16:11:32.861', '2018-11-22 16:11:32.861', NULL, 'baa80310-1f8f-4a40-9ed9-12f7dd58edd7', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2', NULL, 'KryoFlux is a software-programmable FDC (Floppy Disk Controller) system that runs on small ARM7-based devices and connects to a host PC over a USB connector. It reads and writes flux transitions on floppy disks at a very fine resolution.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d5c47137-15a8-458f-81c9-6f6fef4ea555', '2018-11-22 16:11:34.354', '2018-11-22 16:11:34.354', NULL, 'b939230a-e028-4a0b-9bc0-8cae59eb3f80', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.2', NULL, 'KryoFlux is a software-programmable FDC (Floppy Disk Controller) system that runs on small ARM7-based devices and connects to a host PC over a USB connector. It reads and writes flux transitions on floppy disks at a very fine resolution.', NULL, NULL);
