INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('033a30cf-e63d-4908-9ef1-2f08da7a0472', '2018-11-22 16:14:25.457', '2018-11-22 16:14:25.457', NULL, '1c5dce2c-b476-43b1-92c0-f75ec00b69da', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Maxwell Render is a 3D render engine developed by Next Limit Technologies. The Material file defines material properties for 3D objects for use within a Maxwell 3D Scene.', NULL, NULL);
