INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f3e1a01e-d54a-4e3d-bb8e-35eb3c156129', '2018-11-22 16:15:09.178', '2018-11-22 16:15:09.178', NULL, '5f793a86-a176-43f0-a27c-974eb65d8f6a', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This is a proprietary file format created by Microsoft Document Imaging, a program which enables the editing and annotation of documents scanned by Microsoft Office Document Scanning. It was introduced in Office XP and was included in Office 2003 and 2007. This format is a variant of TIFF.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('2e9bf7ba-ccba-41a0-b349-1cf9035daf61', '2018-11-22 16:15:12.709', '2018-11-22 16:15:12.709', NULL, '8e1ca31f-3477-4412-b8fc-63d6ffe25957', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2', NULL, 'The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 2 is the native file format of Microsoft Excel 2.1 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 2 file comprises a single worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c61fbfd9-f732-4c59-a56e-4a726166f6d1', '2018-11-22 16:15:14.9', '2018-11-22 16:15:14.9', NULL, '55eb6cdd-9e34-4d38-a99f-dcc1f0eea5fe', '', NULL, NULL, NULL, NULL, 1, false, true, false, '8X', NULL, 'The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 8X is a native file format of Microsoft Excel XP. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. BIFF 8X is based on Microsoft’s generic OLE2 Compound Document Format. An Excel workbook is stored as a ‘Book’ stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record. The format remained unchanged with the release of Excel 2003.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('4fbc488f-db55-4f7d-831c-e10311d09082', '2018-11-22 16:20:03.196', '2018-11-22 16:20:03.196', NULL, '41cb5680-f3c3-4fe1-b034-e807c5a4914c', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This eBook format was developed by Microsoft for use with the now discontinued Microsoft Reader software. The format itself is derived from the Microsoft Compiled HTML Help format.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('75b3fde2-d7f3-4371-86fa-7361f4e38db2', '2018-11-22 16:15:17.226', '2018-11-22 16:15:17.226', NULL, '63bd6c9b-1bb1-49cc-97a8-a487f8f5ed4c', '', NULL, NULL, NULL, NULL, 1, false, true, false, '3', NULL, 'The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 3 is the native file format of Microsoft Excel 3.0 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 3 file comprises a single worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('51bda1b0-011f-45d1-a0ab-a53fda02c1ad', '2018-11-22 16:15:18.923', '2018-11-22 16:15:18.923', NULL, 'f7882d3a-0df4-4768-8d0e-e6548e6d645f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '4W', NULL, 'The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 4W is a native file format of Microsoft Excel 4.0 for Windows. Excel 4.0 allowed either a single worksheet to be stored as a worksheet file (BIFF 4S), or for multiple worksheets to be combined in a single workbook file (BIFF 4W). The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 4W file comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, one or more embedded Worksheet streams (in BIFF 4S format), and terminated by an End of File (EOF) record.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('52806e39-c222-4285-a558-e17a0e8cc332', '2018-11-22 16:15:20.517', '2018-11-22 16:15:20.517', NULL, 'edccf104-43cc-4b66-907c-a28c270ff1ee', '', NULL, NULL, NULL, NULL, 1, false, true, false, '4S', NULL, 'The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 4S is a native file format of Microsoft Excel 4.0 for Windows. Excel 4.0 allowed either a single worksheet to be stored as a worksheet file (BIFF 4S), or for multiple worksheets to be combined in a single workbook file (BIFF 4W). The format is proprietary and Microsoft does not make details of its structure public. The information contained here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format, and should not therefore be regarded as definitive. BIFF is a stream based format, and a BIFF 4S file comprises a single Worksheet stream, containing a Beginning of File (BOF) record, followed by a series of Worksheet records, and terminated by an End of File (EOF) record.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('e0fb1989-135d-47fe-abbd-ca3ba3e814f2', '2018-11-22 16:15:22.417', '2018-11-22 16:15:22.417', NULL, '59cd1cc4-c71f-4e2c-b635-fd45e92cce90', '', NULL, NULL, NULL, NULL, 1, false, true, false, '5/95', NULL, 'The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 5 is a native file format of Microsoft Excel 5.0 for Windows. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. From Excel 5.0 onwards, BIFF is based on Microsoft’s generic OLE2 Compound Document Format. An Excel workbook is stored as a ‘Book’ stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('9a1a49a7-d4ca-4fed-8838-2178078f1c66', '2018-11-22 16:15:24.289', '2018-11-22 16:15:24.289', NULL, 'e9624f63-21ee-46bc-8b25-a87bbdcb7cb6', '', NULL, NULL, NULL, NULL, 1, false, true, false, '8', NULL, 'The Binary Interchange File Format (BIFF) is a spreadsheet file format developed by Microsoft. BIFF 8 is a native file format of Microsoft Excel 97. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. BIFF 8 is based on Microsoft’s generic OLE2 Compound Document Format. An Excel workbook is stored as a ‘Book’ stream within a Compound Document Format file. The Book stream comprises a Workbook Globals Substream, containing a Beginning of File (BOF) record, the Workbook global records, and terminated by an End of File (EOF) record. This is followed by one or more Worksheet substreams, containing a Beginning of File (BOF) record, the worksheet records, and terminated by an End of File (EOF) record. The format remained unchanged with the release of Excel 2000.', NULL, NULL);
