INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('12557782-1bde-47c1-a290-04a998317b51', '2018-11-22 16:17:26.602', '2018-11-22 16:17:26.602', NULL, 'c27e060c-d7c3-4a54-b485-28b1c96c32fc', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2007 onwards', NULL, 'Microsoft developed office Open XML (OOXML) in 2007. It is an XML based format representing a departure from previous Microsoft Office suites, which were binary file based. Starting with Microsoft Office 2007, the Office Open XML file formats have become the default file format of Microsoft Office. The ISO standard for OOXML is ISO/IEC DIS 29500. An OOXML file format consists of a compressed zip archive that is designated according to which file type it is. OOXML uses three custom XML based languages to describe its’ three document types. WordProcessingML, SpreadsheetML and PresentationML are each used to describe Word, Excel and PowerPoint Presentation files respectively. OOXML is not an open format but the specification and development rights have been released under Microsoft’s Covenant not to Sue. OOXML is platform independent.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('926004ee-5a51-47d5-b538-cdfc67a3f6ed', '2018-11-22 16:17:29.077', '2018-11-22 16:17:29.077', NULL, 'ee1185bb-1647-4790-920f-67a875e054fa', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'When a previously saved Word document is opened for editing, for printing, or for review, Word creates a temporary file that has a .doc file name extension. This file name extension begins with a tilde (~) that is followed by a dollar sign ($) that is followed by the remainder of the original file name. This temporary file holds the logon name of person who opens the file. This temporary file is called the "owner file."', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ed6e9c9c-8954-4cc1-b577-ed87ee083c92', '2018-11-22 16:17:31.597', '2018-11-22 16:17:31.597', NULL, '2b4649a0-88ab-4cd2-adab-93ce6312fccb', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.', NULL, NULL);
