INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('3584efa9-b9ca-4c6e-93d9-f5e83646c311', '2018-11-22 16:17:36.48', '2018-11-22 16:17:36.48', NULL, '5829763b-440d-4d4b-8793-635b8a938a17', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Microsoft OneNote is a computer program for information gathering and multi-user collaboration. OneNote package files are compressed container formats which allow users to share OneNote files across computers. The OneNote File Format is a persistence format for storing digital notes as hierarchical sets of sections and pages. Pages can contain text, images, tables, note tags and other types of user-defined content.', NULL, NULL);
