INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5a48e044-9404-47fe-b869-80a42267f38d', '2018-11-22 16:18:47.069', '2018-11-22 16:18:47.069', NULL, 'c2ce4cce-f8a3-4018-9fbd-63215311ab87', '', NULL, NULL, NULL, NULL, 1, false, true, false, '95', NULL, 'Powerpoint format is a presentation format developed by Microsoft. Powerpoint 95 format is the native format of Powerpoint 95. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. Powerpoint 95 is based on Microsoft’s generic OLE2 Compound Document Format. A Powerpoint presentation is stored as a ‘PowerPoint Document’ stream within a Compound Document Format file.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5b9b2c99-076c-402b-8b1d-fa1aeefb7507', '2018-11-22 16:18:50.612', '2018-11-22 16:18:50.612', NULL, 'dabdd7a2-5ecb-46a5-aeab-09ed00b1b2f7', '', NULL, NULL, NULL, NULL, 1, false, true, false, '97-2003', NULL, 'Powerpoint format is a presentation format developed by Microsoft. Powerpoint 97-2002 format is the native format of Powerpoint 97 onwards. The format is proprietary and Microsoft does not make details of its structure public. Currently PRONOM cannot differentiate Microsoft Powerpoint Presentation 97-2003 and Microsoft Powerpoint Show by signatures. This means Microsoft Powerpoint Show files with extensions of pps will likely identify as the Microsoft Powerpoint Presentation 97-2003 PUID. Further research may be able to address this.', NULL, NULL);
