INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d1d9dbf5-ac50-4f62-bf54-596f99570227', '2018-11-22 16:21:19.277', '2018-11-22 16:21:19.277', NULL, 'c56d9b58-a6dc-4891-aa6c-4327938d4217', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Windows Movie Maker is video editing software by Microsoft. A .mswmm file won''t typically contain any source audio or video data, rather it will contain references or pointers to the source data. For this reason extracting a .mswmm file from its context may result in the movie being unable to play. A movie exported to a video format from within the application will contain the appropriate data for portable playback.', NULL, NULL);
