INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5937cb6b-0a56-41d8-aeee-f5d36f92bb4b', '2018-11-22 16:21:24.592', '2018-11-22 16:21:24.592', NULL, 'ab18ffa3-f867-42a5-a3d6-cc9df9f6a58f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '6.0-2003', NULL, 'This format is identifiable via a container signature in DROID 6 and later. Some Word documents from this era lack an internal [CompObj] stream, which is used by fmt/39 and fmt/40 to distinguish between Word files generated in Microsoft Office 6.0/95, and 97-2003. Since compatible files created by certain software lack this stream (potentially including, but not necessarily limited to Apple Pages), this additional identifying record is required to avoid the limiting identification of OLE2.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ed7602e3-ec8a-4504-8ee9-e2e8a90f84a5', '2018-11-22 16:21:27.172', '2018-11-22 16:21:27.172', NULL, 'f35fc53e-fc04-444e-92ff-a796e24e4235', '', NULL, NULL, NULL, NULL, 1, false, true, false, '6.0/95', NULL, 'With the release of Word 6.0, Microsoft introduced a new native binary word processing format, based on its generic OLE2 Compound Document Format. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Word document is stored as a ‘WordDocument’ stream within a Compound Document Format file. The format remained unchanged with the release of Word 95.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('0ee7aa0a-746f-40a1-9e15-4346745ccd36', '2018-11-22 16:21:29.172', '2018-11-22 16:21:29.172', NULL, 'c312b0f3-6c26-4ef5-88e3-50d342741082', '', NULL, NULL, NULL, NULL, 1, false, true, false, '97-2003', NULL, 'With the release of Word 97, Microsoft revised the native binary word processing format, which is based on its generic OLE2 Compound Document Format. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Word document is stored as a ‘WordDocument’ stream within a Compound Document Format file. The format remained unchanged with the releases of Word 2000, 2002 and 2003. An alternative extension of .wbk refers to a backup file of a Word document, however there is no material or structural difference between a .wbk file and the .doc file it is a backup of.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ce4f4f67-6ef0-44c3-9ed1-cc71d6465e20', '2018-11-22 16:22:07.23', '2018-11-22 16:22:07.23', NULL, '032e7621-f062-474c-a4cb-108dfb326af2', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.0', NULL, 'Word Document format is a word processing format developed by Microsoft. Word 2.0 format is the native file format of Microsoft Word 2.0 for Windows. It is proprietary and Microsoft does not make details of its structure public. A Word document file comprises a header section followed by a text section, which contains the document text in ANSI characters, followed by a format section, which contains formatting information about the text.', NULL, NULL);
