INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('e8f8f2f2-7a71-47a2-b22e-4763dda871c4', '2018-11-22 16:25:23.44', '2018-11-22 16:25:23.44', NULL, '6e8c532f-8efb-44d5-9552-da7ad1300e2f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'MPEG-1 is a lossy compression standard for video and audio, intended for use in Digital Storage Media (DSM) such as VideoCD and DVD (at the same encoding standard as VCD). It is designed to handle video frame-sizes of 352 x 288px, at a frame-rate of 25 frames per second (PAL) and a data rate of around 1.2Mbits/s; audio: up to 320 kbits/s (MPEG-1 Audio Layer III, *.mp3). MPEG-1 supports random access to stream content on playback. MPEG-1 Video supports only ''progressive'' frame video. MPEG-1 compression can be relatively inefficient by modern standards. An MPG-1 ‘Elementary’ stream (ES) file (*.m1v) contains either a single video or audio stream (e.g. *.mp3). ES files are generally intended for video editing or other intermediate use, where separate audio content can be ultimately blended (''interleaved'' or ‘muxed’) with a video stream to produce an output file containing both audio and video for synchronised playback.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('dd37eed5-aff4-4935-96dc-b92d6e02285b', '2018-11-22 16:25:25.677', '2018-11-22 16:25:25.677', NULL, 'f94e2e80-7247-4ab5-8196-e30edf950bda', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'MPEG-1 is a lossy compression standard for video and audio, intended for use in Digital Storage Media (DSM) such as VideoCD and DVD (at the same encoding standard as VCD). It is designed to handle video frame-sizes of 352 x 288px, at a frame-rate of 25 frames per second (PAL) and a data rate of around 1.2Mbits/s; audio: up to 320 kbits/s (MPEG-1 Audio Layer III, *.mp3). MPEG-1 supports random access to stream content on playback. MPEG-1 Video supports only ''progressive'' frame video. MPEG-1 compression can be relatively inefficient by modern standards. An MPG-1 ‘Program’ stream (PS) file (*.mpg, *.mpeg) generally contain both video and audio streams, generally for synchronised playback, and may carry a variety of other data (e.g. video captions).', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('cc2eb171-10c5-4db6-bd63-25f85d36af37', '2018-11-22 16:25:29.022', '2018-11-22 16:25:29.022', NULL, '8ecc5ffa-4470-4420-93ad-c21702e2dfde', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPG2 ‘Elementary’ stream (ES) file (*.m2v) contains either a single video or audio stream. ES files are generally intended for video editing or other intermediate use, where separate audio content can be ultimately blended (''interleaved'' or ‘muxed’) with a video stream to produce an output file containing both audio and video for synchronised playback.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('33173aa4-a02a-4db1-95ab-e3128c2f9c9a', '2018-11-22 16:25:31.458', '2018-11-22 16:25:31.458', NULL, 'dcb49215-070c-4f10-970d-d66d7566bf34', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPG-2 ‘Program’ stream (PS) file (*.mpg, *.mpeg) generally contain both video and audio streams, generally for synchronised playback, and may carry a variety of other data (e.g. video captions).
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('65770058-e187-4da1-b303-cb46a881cf54', '2018-11-22 16:25:34.103', '2018-11-22 16:25:34.103', NULL, '0cdaf640-dca5-4b68-9a62-7433d97f4d43', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'MPEG-2 is a lossy compression standard (an improvement and expansion of the MPEG-1 standard) designed for the generic coding of video and audio and intended to cover a wide scope of application, including: video production, broadcast and editing. Streams are at potentially higher bitrates than MPEG-1 but more efficient compression making it suited to High Definition video. MPEG-2 Video supports both ''progressive'' and ''interlaced'' frame video. An MPEG-2 ''Transport'' stream file (TS) file (*.ts, *.m2ts) is designed for low-latency, real-time transmission and is used in broadcasting. It can contain multiple programmes, not necessarily intended for synchronised playback. TS incorporates features that can allow flexible access to and playback of stream content.', NULL, NULL);
