INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('2526daf2-537a-4a09-853a-00516d8f7d09', '2018-11-22 16:25:38.11', '2018-11-22 16:25:38.11', NULL, '3cbcc21b-1a8e-4833-b2b9-a3218e7fe873', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'MrSID is an acronym that stands for Multiresolution Seamless Image Database. It is a wavelet-based file format developed and patented by LizardTech designed to enable portability of massive bit-mapped (raster) images, such as orthophotos. MrSID was originally developed for Geographic Information Systems (GIS). With this format, large raster image files such as aerial photographs or satellite imagery are compressed and can be quickly viewed without having to decompress the entire file. There is no open source implementation of the MrSID format. Some open source GIS systems can read MrSID files, including MapWindow GIS and those based on GDAL. The Decode Software Development Kit (SDK) is made available as a free download from developer.lizardtech.com. This enables the capability to implement MrSID reading capability in any application.', NULL, NULL);
