INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('125b378b-1a09-4fe6-93be-984ae996a193', '2018-11-22 16:27:04.775', '2018-11-22 16:27:04.775', NULL, '29128da3-6d3f-4e01-aa78-ca404141e5cb', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Notation3, or N3, is a shorthand non-XML serialization of Resource Description Framework models.', NULL, NULL);
