INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('bb681798-b784-46e0-bdd9-52096193ffd9', '2018-11-22 16:27:08.05', '2018-11-22 16:27:08.05', NULL, '1708c027-cabb-4689-a43a-fce820e24b8e', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'NSIS (Nullsoft Scriptable Install System) is an open source system to create Windows installers. NSIS is script-based and although it has regular and well defined syntax, there are no magic numbers or header sequences. As such, there is no current means to identify a file as NSIS by binary sequence alone, so identification of this format is by extension only.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8fa27fb5-c3c4-4bd8-8a40-b77e51821d05', '2018-11-22 16:27:10.116', '2018-11-22 16:27:10.116', NULL, '8f3e9a43-80a0-4ad1-873d-7e4e938c9d6b', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The Nullsoft Streaming Video (NSV) format is a multimedia container format designed to enable streaming of video and audio.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ab933c2f-fb3a-4c54-8a07-b3048db427a6', '2018-11-22 16:27:12.159', '2018-11-22 16:27:12.159', NULL, '9d6e223a-6bb8-407b-acf1-6c6c940403b8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'NUT is a container format for the storage of audio, video, subtitles and other related user defined streams. It provides an exact timestamp for synchronization and seeking.', NULL, NULL);
