INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('16a082c4-b56a-4966-991d-101d87ee96e4', '2018-11-22 16:27:19.523', '2018-11-22 16:27:19.523', NULL, 'd7ec617c-88d0-46c0-9c50-17345870c4c8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Ogg is a free, open container format maintained by the Xiph.Org Foundation. The Ogg container format can multiplex a number of independent streams for audio, video, text, and metadata.
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('19220e0f-e32e-4cb6-8395-c311db8a17c6', '2018-11-22 16:27:21.944', '2018-11-22 16:27:21.944', NULL, '927a0a27-ca16-4e35-8266-976c4b0e197e', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Ogg is a open container format maintained by the Xiph.Org Foundation, while Opus is a lossy audio coding format developed by Xiph and intended to replace the Vorbis codec.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6260206b-2100-4651-a562-6aca8bf298de', '2018-11-22 16:27:24.219', '2018-11-22 16:27:24.219', NULL, '0598f41e-4fcc-4343-9d02-22f10c447f29', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Ogg is a open container format maintained by the Xiph.Org Foundation. The Speex codec is a lossy codec aimed at handling low bitrate audio, particularly speech.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('232739d3-416f-4aaa-8aad-db60e4da13cb', '2018-11-22 16:27:25.927', '2018-11-22 16:27:25.927', NULL, '7baa97c7-b755-4ad7-8b4a-a8908d13bf35', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Ogg is a free, open container format maintained by the Xiph.Org Foundation. The Ogg container format can multiplex a number of independent streams for audio, video, text, and metadata.
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('6bb3099d-4d82-4961-a31d-b7905fc652d1', '2018-11-22 16:27:27.49', '2018-11-22 16:27:27.49', NULL, '8da3cad7-051a-4cd4-957e-e6fd8f20783f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Ogg is a open container format maintained by the Xiph.Org Foundation. Vorbis is a free and open-source software project headed by the Xiph.Org Foundation and produces an audio coding format and software reference encoder/decoder (codec) for lossy audio compression.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('811c7611-7ea2-407e-ab57-fe34705847e7', '2018-11-22 16:27:29.38', '2018-11-22 16:27:29.38', NULL, '4416703a-edb5-4be3-b0a2-75c8611efd86', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The GFS file is used by the OGR Geography Markup Language reader to predefine dataset level information in the absense of an XML Schema definition for the feature classes within the GML file. Its purpose and syntax is described here: http://www.gdal.org/drv_gml.html', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('52c49dfb-cc50-48e7-8027-ef303722328a', '2018-11-22 16:27:31.565', '2018-11-22 16:27:31.565', NULL, '6901889f-80bb-403a-a03f-50c16636f458', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Ogre Mesh is a binary format for representing 3D models for use within the Ogre 3D rendering engine. PRONOM currently does not distinguish between minor versions of the format. Please contact the PRONOM team if this is desirable.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('02ef66df-2661-4593-98e4-74bb1c417f7f', '2018-11-22 16:27:34.106', '2018-11-22 16:27:34.106', NULL, '670a7e61-0584-4d2c-bdee-21a9d041d8f3', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Ogre Mesh XML is an XML-based format for representing 3D models for use within the Ogre 3D rendering engine.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f2ffaa11-10c4-4123-b67f-cccd0cc8d568', '2018-11-22 16:27:37.044', '2018-11-22 16:27:37.044', NULL, '7f399fe0-2c3e-4c3c-b327-103260a10ec7', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Oktalyzer is an audio sequencer developed by Armin Sander for the Amiga in 1989. Note, this is an Amiga filetype, where the ''extension'' is a prefix rather than suffix, hence most Oktalyzer files will follow the okt.filename convention.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('15203885-687d-43bd-8030-ad67d1ecd864', '2018-11-22 16:27:39.725', '2018-11-22 16:27:39.725', NULL, '848e6358-9374-4e0b-bb24-be2da1612d5b', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The OLE2 Compound Document Format is a generic document format developed by Microsoft as the underlying native binary format for many of its Office applications. The format is proprietary and Microsoft does not make details of its structure public. The information here is derived primarily from OpenOffice.org''s reverse-engineered documentation of the format and should not therefore be regarded as definitive. A Compound Document acts as a file system in which independent data streams are organised within a hierarchy of containers, called storages. All storages and streams are contained within a parent Root Storage. A Directory Stream indexes every stream and storage in the file. A Compound Document begins with the Compound Document Header, including pointers to the location of the Directory Stream and Master Sector Allocation Table. The remainder of the file is organised into Sectors, the positions of which are defined in the Sector Allocation Table and Master Sector Allocation Table.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('7111cd5a-4958-44ae-84d8-f9b14b90dbf5', '2018-11-22 16:27:42.053', '2018-11-22 16:27:42.053', NULL, 'aee3c6b5-72f5-4ecd-8357-a0c85e5e0bba', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Olympus raw format (.orf) is a raw image format used by models of Olympus digital cameras.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ea4e0bc0-db75-424f-83b7-663e0f06629f', '2018-11-22 16:27:44.415', '2018-11-22 16:27:44.415', NULL, '0b4eb94b-5e0c-4d35-851d-e17051e571e6', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'OMNIC Spectral Data files are spectroscopy data files produced by Thermo Scientific OMNIC software.', NULL, NULL);
