INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('7d145c6c-f193-4d3e-b708-3a3967fc948d', '2018-11-22 16:28:09.731', '2018-11-22 16:28:09.731', NULL, '73c4face-8d73-4207-8ca3-51f610951b50', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'OpenDocument (ODF) format is a generic format for office documents, such as text, spreadsheets, presentations, drawings, and databases. It was developed by OASIS, based on the original OpenOffice document format. The format is an open standard, and is supported by a variety of office software packages. ODF is an XML format, which may comprise a single XML document, or a collection of subdocuments within a package. The package format is the commonly used form, and comprises a standard ZIP package containing the XML content and any associated binary data, together with a manifest which lists the package content. An ODF database document contains a relational database. The content is contained in a ''content'' xml subdocument. Additional subdocuments contain style information, document metadata, and application-specific settings.', '2005-05-01 00:00:00', NULL);
