INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('ac91d302-eb79-4561-a1c1-e4bf225cd151', '2018-11-22 16:28:44.301', '2018-11-22 16:28:44.301', NULL, '6d7187e2-a027-412e-8f85-f769fa32eabc', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2', NULL, 'OpenEXR is a raster image file format developed by Industrial Light and Magic for use in computer imaging applications. The published specification for OpenEXR describes version 2 of the file format. Version 1 was used internally by Industrial Light and Magic before OpenEXR was released as open source.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('4c7545e7-72f3-47a7-9019-3e0a77ff4793', '2018-11-22 16:28:46.449', '2018-11-22 16:28:46.449', NULL, 'd5b475e0-9a66-42a2-8c57-e41fa1fd9bf9', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'All OpenOffice v1.0 documents (Calc, Draw, Impress, Writer) use the extensible Markup Language (XML) for representing the elements and attributes of each structural component of the document. As XML has no native support for binary objects, OpenOffice.org files use a standard Zip file to store the XML content together with its associated binary data. Information about the files contained in the Zip file is stored in an XML file called the manifest file. The manifest file is always stored at the pathname META-INF/manifest.xml. The manifest file contains a list of all the files in the Zip file, the media type of each file, and the information necessary to decrypt any encrypted files included in the Zip file.', NULL, NULL);
