INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('84c6f26c-8b62-4a61-8f4c-16d966b24c94', '2018-11-22 16:30:35.529', '2018-11-22 16:30:35.529', NULL, '269ad051-03c1-4c13-8421-71d582dce4de', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.0', NULL, 'Portable Document Format is a platform-independent format for representing formatted documents, originally developed by Adobe Systems Incorporated. PDF 2.0 is standardised by ISO 32000-2. A PDF file comprises a Header section, a Body section containing the objects which make up the document, a Cross Reference Table, and a Trailer section. PDF files can contain a wide variety of content, including text, images, video and audio.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('4f945bbf-6b4b-49b6-902e-08de96981cac', '2018-11-22 16:30:37.859', '2018-11-22 16:30:37.859', NULL, '2ec83e39-8f1c-4487-ad43-aa55c70faa70', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'PEA (an acronym of Pack Encrypt Authenticate) is the native format of PeaZip, an open source file archiver created by Giorgio Tani.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('74c436db-e044-4f38-8550-ca4bdfd2f154', '2018-11-22 16:30:40.484', '2018-11-22 16:30:40.484', NULL, '3718b18d-8abc-4296-826c-d6536f00b9e8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Peak files contain waveform information for audio files (e.g. wav or mp3). They allow some applications to generate a graphical representation of the waveform of the audio content of associated audio files, and can enable such audio files to be accessed more quickly by reducing the time it takes to draw the waveform of the audio content.', NULL, NULL);
