INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('7f52dd51-2a15-4181-96c7-3ba8623a47f8', '2018-11-22 16:31:36.774', '2018-11-22 16:31:36.774', NULL, '100477a1-6510-4281-b26f-3ae6104251fb', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Developed by Hewlett Packard, Polynomial texture maps (PTMs) are an extension to conventional texture maps that allow enhanced image quality. As opposed to storing a color per pixel, these PTM’s store second-order bi-quadratic polynomial coefficients per pixel. These polynomials model the changes that appear to a pixel color based on either light source position or viewing direction.', NULL, NULL);
