INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5f6d9cfe-7d2e-4b21-9c65-7d40cb177ca5', '2018-11-22 16:32:00.944', '2018-11-22 16:32:00.944', NULL, 'b6d4c423-0100-469c-9921-ed388cd490af', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'Portable Network Graphics (PNG) was designed for the lossless, portable, compressed storage of raster images.  PNG provides a patent-free replacement for GIF and can also replace many common uses of TIFF. Indexed-color, grayscale, and truecolor images are supported, plus an optional alpha channel. Sample depths range from 1 to 16 bits. PNG is designed to work in online viewing applications, so it is fully streamable.  It can store gamma and chromaticity.  PNG also detects file corruption.', NULL, NULL);
