INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('221bcb5e-5dc2-4468-b736-249ca1fdd7d3', '2018-11-22 16:34:58.206', '2018-11-22 16:34:58.206', NULL, '687fd2e6-d406-46ac-8c5c-a0fa61f2ed6a', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The QuickTime file format is a format for storing multimedia content, principally video, developed by Apple. The basic data unit in a QuickTime file is the atom. Each atom contains size and type information along with its data. The size field indicates the number of bytes in the atom, including the size and type fields. The type field specifies the type of data stored in the atom and, by implication, the format of that data. Atoms are hierarchical in nature. That is, one atom can contain one or more other atoms of varying types. For example, a movie atom contains one track atom for each track in the movie. The track atoms, in turn, contain one or more media atoms each, along with other atoms that define other track and movie characteristics. This hierarchical structure of atoms is referred to as a containment hierarchy. A QuickTime file is simply a collection of atoms. QuickTime does not impose any rules about the order of these atoms.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('53f27d1a-8dbd-4bd2-a0f4-e818bb6c6f61', '2018-11-22 16:35:00.014', '2018-11-22 16:35:00.014', NULL, '8b1780f4-9e27-4c61-8d5d-bce5a9721ea8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Radiance defined an image format for storing HDR images, now described as RGBE image format. RGBE stores pixels as one byte each for RGB (red, green, and blue) values with a one byte shared exponent. Thus it stores four bytes per pixel.', NULL, NULL);
