INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('9426e109-55ff-4534-ad2d-dd975fac0554', '2018-11-22 16:35:35.08', '2018-11-22 16:35:35.08', NULL, '1ddfe9bf-a14c-44a7-8936-1ad7525ccc78', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1', NULL, 'REDCODE RAW (R3D) is a proprietary multimedia audio/video file format owned by the Red Digital Cinema Camera Company and featuring lossy compression for video contents and lossless for audio contents. It is used as native recording format of Red digital cameras and recorded on proprietary Hard Disk Drives, CompactFlash cards or SSD drives, but can be extracted from there and be trivially handled in any file-based audio/video, IT or home environments.', NULL, NULL);
