INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('e96bf73a-6484-4a12-bb19-95c614760b73', '2018-11-22 16:35:58.584', '2018-11-22 16:35:58.584', NULL, '90cb7c06-4a8e-4ce6-a0cd-d5bc5fa3bdee', '', NULL, NULL, NULL, NULL, 1, false, true, false, '0', NULL, 'Rich Text Format (RTF) is a format developed by Microsoft to encode formatted text and graphics for use within applications or for data and formatting transfer between applications. It is closely associated with Microsoft Word, and new versions are developed with each release of Word. RTF files are encoded in plain text, typically ASCII, and consists of a series of control words, control symbols and groups. An RTF file comprises a Header section, containing various header tables, followed by a Document section, containing the document content and formatting.
