INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c3338405-f9fa-45e0-83c8-681dfb2f89f2', '2018-11-22 16:36:44.594', '2018-11-22 16:36:44.594', NULL, '95b0f138-7d07-4f05-80cc-606ba2efad7f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'SVG is a language for describing two-dimensional graphics in XML. SVG allows for three types of graphic objects: vector graphic shapes (e.g., paths consisting of straight lines and curves), images and text. Graphical objects can be grouped, styled, transformed and composited into previously rendered objects. The feature set includes nested transformations, clipping paths, alpha masks, filter effects and template objects. SVG drawings can be interactive and dynamic. Animations can be defined and triggered either declaratively (i.e., by embedding SVG animation elements in SVG content) or via scripting.', NULL, NULL);
