INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('035903b1-6ade-498e-8c93-e99565c6293d', '2018-11-22 16:37:46.821', '2018-11-22 16:37:46.821', NULL, '2d57991b-08ab-4cf0-bfd9-84e02761e875', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'SHA-1 (Secure Hash Algorithm 1) is a cryptographic hash function designed by the United States National Security Agency and is a U.S. Federal Information Processing Standard published by the United States NIST. SHA-1 produces a 160-bit (20-byte) hash value. It can be used as a checksum to verify data integrity. The SHA1 file is a text document which contains single or multiple SHA1 values.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('910a4411-3533-4836-949f-15e579a9ac96', '2018-11-22 16:37:49.367', '2018-11-22 16:37:49.367', NULL, 'a2f6688e-19df-4b6d-88e9-d6f156094459', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'SHA256 is part of the family of SHA-2 (Secure Hash Algorithm 2) hash functions which are designed by the United States National Security Agency. SHA256 prodcues a 256-but (32-byte) hash value. It can be used as a checksum to verify data integrity. The SHA256 file is a text document which contains single or multiple SHA1 values.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('44ffba9e-deb2-4282-8d62-3b2a2b0cffdf', '2018-11-22 16:38:30.288', '2018-11-22 16:38:30.288', NULL, '3c77c852-9efa-42a9-bc5a-e9fbe09c0c09', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Snap Survey provides a selection of software which allows users to design surveys.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('06efa0cc-b35d-401e-a929-40f66b9eae09', '2018-11-22 16:37:51.178', '2018-11-22 16:37:51.178', NULL, '56547477-bb62-41b9-ba1a-dbd2a01b897f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'This is an outline record only, and requires further details, research or authentication to provide information that will enable users to further understand the format and to assess digital preservation risks associated with it if appropriate. If you are able to help by supplying any additional information concerning this entry, please return to the main PRONOM page and select ‘Add an Entry’.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f1f2d220-7e18-4e38-940c-2c04e98c2f0f', '2018-11-22 16:37:53.073', '2018-11-22 16:37:53.073', NULL, '37ce4fd3-0c89-45b8-8819-f46459475222', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure (database metadata) as well as a collection of XML files describing the table content (database primary data) as well as - optionally - some text files and some binary files representing database large objects (BLOBs and CLOBs). SIARD format is used for archiving databases adhering to the SQL (ideally SQL:1999 core) standard.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('fc1ad2a4-77fa-4be7-9581-1ff38138b4be', '2018-11-22 16:37:55.194', '2018-11-22 16:37:55.194', NULL, 'b35c2620-56b9-4bc4-ae3b-51bb4db21826', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.0', NULL, 'Software-Independent Archiving of Relational Databases is a format for storing content of relational databases in files for long-term preservation e.g. in archives. The format was developed by the Swiss Federal Archives. It is an open standard and is supported by the SIARD software of the Swiss Federal Archives. SIARD format is a ZIP file (based on the 64 bit extension of the  ZIP format introduced by PkWare Inc. with version 4.5 of the ZIP format definition in order to avoid size limitations which are unrealistic for databases). The ZIP file contains an XML file describing the database structure and metadata as well as a collection of XML files describing the table content (database primary data) as well as, optionally, some text files and some binary files representing database large objects (BLOBs and CLOBs).', NULL, NULL);
