INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('7bf3a2ca-53da-4c8a-997c-24231cb027ad', '2018-11-22 16:38:55.165', '2018-11-22 16:38:55.165', NULL, '3c05ec4a-4a46-4c7d-b874-34df1cb673fb', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'SPSS (Statistical Package for the Social Sciences) is a software package used for statistical analysis in the social sciences. The first version of SPSS was developed by SPSS Inc. in 1968 and has since had eighteen stable version releases.  In 2009 SPSS Inc. was acquired by IBM.  As of version 17.0.1 SPSS software has been known as Predictive Analytics Software. SPSS is used widely by both academics and other social researchers.
