INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a4386cf2-ddaa-4860-bcfd-53e4595d8a94', '2018-11-22 16:42:00.77', '2018-11-22 16:42:00.77', NULL, 'cddec77c-30a7-4b13-9271-33d4d66951b9', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2', NULL, 'A Neuroimaging format used in medical industry for the analysis of scans of x-rays. Version 2 is an extended version of NIfTI allowing 64 bit storage and addressing.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('e5155c26-7ab0-4d86-97b2-4b18688b556a', '2018-11-22 16:42:02.844', '2018-11-22 16:42:02.844', NULL, '3f0925ca-c02e-4c22-a7f3-25c5a3e2c9c4', '', NULL, NULL, NULL, NULL, 1, false, true, false, 'XP', NULL, 'A thumbs.db file is generated automatically within Microsoft Windows environments (although the automatic creation behaviour can be turned off). It is generally a hidden system file and its purpose is to hold thumbnail images of any images stored within a given folder. This format is based on the OLE2 Compound Document Format and can be identified in DROID 6 and later via a container signature. Structurally it holds a Catalog file that indexes the thumbnails, and a file per image that contains the image data in a JPEG format with additional data preceeding the image data. At this time the signature is the result of reverse engineering work conducted by Ross Spencer, Richard Lehane and others. The Catalog file consists of a 4 byte opening sequence that appears to act as an identifier and database version number, followed by two bytes indicating the number of images within the thumbs.db file, followed by information relating to the resolution of the images. This signature is likely to be improved with further research and a better understanding of the format structure. This particular format is known to be produced in Windows XP environments, but may also apply to other Windows operating systems. Later thumbs.db files hold a different structure which cannot yet be suitably represented within a DROID container signature.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('1938cbd9-449c-40cc-97eb-750768aaef88', '2018-11-22 16:42:04.34', '2018-11-22 16:42:04.34', NULL, '2300fd37-fdf3-48c9-82dc-382ad18783fb', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'TransXChange is a UK national data standard for the exchange of bus route and timetable information. The standard is sponsored by the UK Department for Transport and is mandated by the Vehicle Operating Services Agency (VOSA) for the electronic registration of UK bus services with Traffic Area Offices (TAO) and Local Authorities. It is a subset of XML.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('16892f59-6a53-4594-bc5e-018ab1b15609', '2018-11-22 16:42:05.898', '2018-11-22 16:42:05.898', NULL, '6496dfad-5130-4346-bdee-f082ae35b7c8', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'TRIM is an electronic document and records management system developed by Hewlett Packard. The TRIM Context Reference file contains metadata relating to a digital object and acts as a link to that object.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('122f6f13-71b1-45d3-9006-7e866dd7abfe', '2018-11-22 16:42:07.534', '2018-11-22 16:42:07.534', NULL, '75c8ceff-edfa-4a5c-aecd-3d7e128769ca', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1', NULL, 'True Audio is a lossless audio compression format for multichannel 8, 16 and 24 bits audio data.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a3b5e825-3431-49ff-8782-3dad1362f8fe', '2018-11-22 16:42:09.45', '2018-11-22 16:42:09.45', NULL, '0117d107-ff94-40d0-b1d6-f0ce2b542e23', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2', NULL, 'True Audio is a lossless audio compression format for multichannel 8, 16 and 24 bits audio data.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('40ce3307-f9d9-4e45-83ca-41849e7e6109', '2018-11-22 16:42:11.737', '2018-11-22 16:42:11.737', NULL, 'd0baa59b-2689-46ee-ae8b-8c7221c0c05d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Created by Apple, TrueType Font files are a sequence of concatenated tables (a table is a sequence of words; each table must be long aligned and padded with zeroes if necessary). The first of the tables is the font directory, a special table that facilitates access to the other tables in the font. The directory is followed by a sequence of tables containing the font data. These tables can appear in any order. Certain tables are required for all fonts. Others are optional depending upon the functionality expected of a particular font. The tables have names known as tags. Tags have the type uint32. Currently defined tag names consist of four characters. Tag names with less than four characters have trailing spaces. When tag names are shown in text they are enclosed in straight quotes. Tables that are required must appear in any valid TrueType font file. Also notable is that Apple makes a distinction between a "TrueType font" (which refers to a particular font outline definition technology) and an "sfnt-housed font," which refers to any font which uses the same packaging format as a TrueType font: that is, it uses the same directory structure and the same table format and meaning for any tables present.', '2003-12-18 00:00:00', NULL);
