INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('c7de15c8-4d6d-4c7e-b7bf-f774f70e7f12', '2018-11-22 16:43:38.251', '2018-11-22 16:43:38.251', NULL, 'ee60783f-f0cd-4921-a741-8b11d1f7e9b9', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'The Virtual Reality Modeling Language (VRML) is a language for describing multi-participant interactive simulations - virtual worlds networked via the global Internet and hyper-linked with the World Wide Web. All aspects of virtual world display, interaction and internetworking can be specified using VRML. It was created with the goal of becoming the standard language for interactive simulation within the World Wide Web. The first version of VRML allows for the creation of virtual worlds with limited interactive behaviour. These worlds can contain objects which have hyper-links to other worlds, HTML documents or other valid MIME types. Nodes are arranged in hierarchical structures called scene graphs, which also define an ordering of the nodes.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('77835614-df08-49d7-adb4-0dffe2c061cd', '2018-11-22 16:43:40.488', '2018-11-22 16:43:40.488', NULL, 'cc246ff3-bef0-428d-8bae-12258ea7df8c', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.0', NULL, 'The Virtual Reality Modeling Language (VRML) is a file format for describing 3D interactive worlds and objects. It may be used in conjunction with the World Wide Web. It may be used to create three-dimensional representations of complex scenes such as illustrations, product definition and virtual reality presentations.  VRML is capable of representing static and animated objects and it can have hyperlinks to other media such as sound, movies, and image. Interpreters (browsers) for VRML are widely available for many different platforms as well as authoring tools for the creation VRML files. VRML supports an extensibility model that allows new objects to be defined and a registration process to allow application communities to develop interoperable extensions to the base standard. There is a mapping between VRML elements and commonly used 3D application programmer interface (API) features.', NULL, NULL);
