INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('f14fd4a4-ad89-4f99-a181-592ce150eb21', '2018-11-22 16:43:56.328', '2018-11-22 16:43:56.328', NULL, 'ef08df07-2593-4c7a-bf9b-44cd796be219', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'VivoActive is an audio/video format created by Vivo Software, acquired by RealNetworks in 1997. It uses H.263 video and G.723 ADPCM audio. VivoActive uses inter-frame coding, but does not insert any key frames, except at the beginning of the clip, which effectively disables the possibility of seeking to specific locations in the stream. The VivoActive technology was integrated to the RealMedia, the .viv format was replaced by .rm (RealMedia).', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('0e39c370-353f-4c1a-a296-0c165da4f74f', '2018-11-22 16:43:58.183', '2018-11-22 16:43:58.183', NULL, 'c1bef1f0-1588-482f-ac84-ad9bd83a2945', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'VLW is a font file created by the Processing Development Environment. At this stage no identification signature exists, but this may be possible with further research.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('65c3cbe3-c8fb-4e3d-9931-c34bdaf04053', '2018-11-22 16:44:00.108', '2018-11-22 16:44:00.108', NULL, '3126fb1d-6876-4d58-80df-536d6f87f36d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'The WARC (Web ARChive) file format offers a convention for concatenating multiple resource records (data objects), each consisting of a set of simple text headers and an arbitrary data block into one long file. The WARC format is an extension of the ARC file format (ARC) that has traditionally been used to store "web crawls" as sequences of content blocks harvested from the World Wide Web (…)
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('844ade46-414f-40cc-8c25-90cdef747175', '2018-11-22 16:44:02.47', '2018-11-22 16:44:02.47', NULL, '2825eef3-c011-45c3-adfc-838e5c3026e4', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Waveform Audio (WAVE) is a chunk-based audio format developed by Microsoft, based on the generic Resource Interchange File Format (RIFF) specification developed by Microsoft and IBM. Structurally, a WAVE file is composed of a number of chunks, each comprising a four character code chunk identifier, the chunk size, and the chunk data. It  comprises a RIFF header with a WAVE data type identifier, followed by a series of chunks. Every file must include a Format chunk, which describes the format of the audio data, and a Data chunk, containing the audio data itself. Other optional chunks are also allowed. The format supports a wide variety of compressed and uncompressed audio encodings.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('43447c06-bbf9-4d2c-b612-82e95a0d0c7c', '2018-11-22 16:44:05.551', '2018-11-22 16:44:05.551', NULL, '64eb018c-7458-498c-9ca5-64f6db914057', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Waveform Audio (PCMWAVEFORMAT) is the standard Waveform Audio file format, developed by Microsoft. It has now been superseded by Waveform Audio (WAVEFORMATEX), an extended version.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('8dbe05f9-4c04-4ba0-ba3f-60833e5bae64', '2018-11-22 16:44:07.345', '2018-11-22 16:44:07.345', NULL, 'b2c27d5c-7980-469e-9455-784cc8ededab', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Waveform Audio (WAVEFORMATEX) is an extended version of the Waveform Audio file format, and was developed by Microsoft. It has superseded the Waveform Audio (PCMWAVEFORMAT).', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('732f3271-5508-4d2a-9bdf-d5a3e82402d5', '2018-11-22 16:44:09.378', '2018-11-22 16:44:09.378', NULL, '7db3b281-445d-448a-a8b6-c19ca141ee12', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Waveform Audio (WAVEFORMATEXTENSION) is an extended version of the Waveform Audio file format, and was developed by Microsoft. It is related to the Waveform Audio (WAVEFORMATEX) format, but is an even more extended version.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d9473ae4-60c6-411f-b880-95d4b4a3cc15', '2018-11-22 16:44:12.009', '2018-11-22 16:44:12.009', NULL, 'a8ebb1fc-3b6f-4eb3-90f9-bf8998120fef', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'MTL is a companion file for the Wavefront OBJ file. The MTL file describes surface shading properties for use by one or more OBJ.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a7844c4b-a7e1-45cc-910f-8ca455314275', '2018-11-22 16:44:13.497', '2018-11-22 16:44:13.497', NULL, '5825bcea-85b1-4685-9080-0c78b5860f55', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'OBJ is an ASCII format for representing 3D geometry. The OBJ format supports both polygonal objects and free-form objects. Polygonal geometry uses points, lines, and faces to define objects while free-form geometry uses curves and surfaces.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('e3a9c70f-9416-4f77-9660-1e8ca40eebb3', '2018-11-22 16:44:15.017', '2018-11-22 16:44:15.017', NULL, '40338c6f-ab8f-47ea-8286-8e45219576ce', '', NULL, NULL, NULL, NULL, 1, false, true, false, '1.0', NULL, 'Web Open Font Format (WOFF) is a font format designed primarily for use on the Web, and can also be used as a container format or "wrapper" for font data in already-existing formats.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('1f72edff-eb31-4cb8-8993-6f0bd13e2433', '2018-11-22 16:44:16.809', '2018-11-22 16:44:16.809', NULL, '30e0f63c-bd92-48e2-950e-137d926daa1d', '', NULL, NULL, NULL, NULL, 1, false, true, false, '2.0', NULL, 'Web Open Font Format (WOFF) is a font format designed primarily for use on the Web, and can also be used as a container format or "wrapper" for font data in already-existing formats. WOFF 2 was developed to provide improved compression over WOFF 1.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('7cd67979-65a9-4875-bc79-68f547451534', '2018-11-22 16:44:18.782', '2018-11-22 16:44:18.782', NULL, '32933fb5-3c13-48e4-a657-a29723714437', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'WebM is a media file format, developed by Google based on the Extensible Binary Meta Language.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('680c57c3-c394-4949-8bac-93f3a0a04350', '2018-11-22 16:44:20.988', '2018-11-22 16:44:20.988', NULL, '7f3889f5-a704-4d12-ae03-6c9107704461', '', NULL, NULL, NULL, NULL, 1, false, true, false, 'Extended', NULL, 'WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. The extended version of the format allows for alternative colour profiles and animation.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('a2f21c35-d036-4b28-8451-03f32017a38a', '2018-11-22 16:44:23.521', '2018-11-22 16:44:23.521', NULL, '561c0c85-a480-43e7-848c-1ffeb26553db', '', NULL, NULL, NULL, NULL, 1, false, true, false, 'Lossless', NULL, 'WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. WebP’s lossless compression uses advanced techniques such as dedicated entropy codes for different color channels, exploiting 2D locality of backward reference distances and a color cache of recently used colors. This complements basic techniques such as dictionary coding, Huffman coding and color indexing transform.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('0e15f338-ab70-48b8-ad1a-b74805b75867', '2018-11-22 16:44:25.32', '2018-11-22 16:44:25.32', NULL, '823f5600-22d8-4568-837f-7133a1a13ba2', '', NULL, NULL, NULL, NULL, 1, false, true, false, 'Lossy', NULL, 'WebP is a raster image format developed by Google that uses the Resource Interchange File Format as a container. WebP''s lossy compression algorithm is based on the intra-frame coding of the VP8 video format.', NULL, NULL);
