INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5951aa09-b2e2-4a9f-a8e1-f3a5ab06c7de', '2018-11-22 16:44:45.27', '2018-11-22 16:44:45.27', NULL, '23501cba-92c6-4d59-9861-089f2be92de6', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'JNT is the native format of Windows Journal, a notetaking application created by Microsoft for Windows operating systems starting with Windows XP. Due to security concerns Microsoft advise against using the format and have supplied a patch for removal of the application (https://support.microsoft.com/en-gb/help/3161102/update-for-windows-journal-component-removal). Microsoft also provide an update that re-installs a version of Windows Journal that highlights the security concerns (https://support.microsoft.com/en-us/help/3162655/windows-journal-application-for-windows). A JTP is a Windows Journal Template file, however this appears to be structurally identical to a JNT file.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('b49fb1ce-2c74-45d8-ada4-1b66541261dc', '2018-11-22 16:44:47.3', '2018-11-22 16:44:47.3', NULL, '49bfd3a8-c86e-4899-89be-c724ccce3d79', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Windows Media Audio Format is a subtype of the Advanced Systems Format, developed by Microsoft for storing audio data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. Audio data is stored using the Windows Media Audio codec, and the format supports streaming across networks.', '2004-12-01 00:00:00', NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('615c0610-aa4a-46ee-8566-62ef0df3f9d6', '2018-11-22 16:44:48.745', '2018-11-22 16:44:48.745', NULL, 'bb76ade7-013a-40dd-acc8-dac1979a2cf7', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'A media metafile is a file that contains information about other files. A metafile can be used to list a group of media content files that are to be played in order. The .wax metafile references Windows Media files with .asf, .wma, or .wax file name extensions. The .wvx metafile references Windows Media files with .wma, .wmv, .wvx, or .wax file name extensions. The asx metafile references Windows Media files with .wma, .wax, .wmv, .wvx, .asf, or .asx file name extensions.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('025f7d6b-1363-48e8-9f76-8fd80148a5fd', '2018-11-22 16:44:50.228', '2018-11-22 16:44:50.228', NULL, 'd7b72b45-10bf-4e12-b656-fa3f20728235', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Windows Media Player Playlist is a file format that stores multimedia playlists. It is a proprietary file format used in Microsoft Windows Media Player versions 9-12.', NULL, NULL);
INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('5df485a3-5185-48f8-9409-9237f843656a', '2018-11-22 16:44:52.016', '2018-11-22 16:44:52.016', NULL, 'b8673f4f-a779-4560-a73d-ab6a035f6f5a', '', NULL, NULL, NULL, NULL, 1, false, true, false, '', NULL, 'Windows Media Video Format is a subtype of the Advanced Systems Format, developed by Microsoft for storing video data streams. It comprises a Header Object, which describes the properties of the data streams, a Data Object, which contains the actual data streams stored in Data Packets and, optionally, one or more Index Objects. Video data is stored using the Windows Media Video codec, and the format supports streaming across networks.', '2004-12-01 00:00:00', NULL);
