INSERT INTO public.arclib_format_definition (id, created, updated, deleted, format_id, format_note, national_format_guarantor, preservation_plan_description, preservation_plan_file_id, previous_internal_definition_id, internal_version_number, local_definition, preferred, internal_information_filled, format_version, format_classification, format_description, release_date, withdrawn_date) VALUES ('d3de8566-29a8-4b9b-9872-1fb72e0e0b60', '2018-11-22 16:45:47.604', '2018-11-22 16:45:47.604', NULL, 'ce977d40-8e49-43d4-b910-689490c0c82f', '', NULL, NULL, NULL, NULL, 1, false, true, false, '3.0', NULL, 'Microsoft Write is a basic word processor included with Windows 1.0 and later, until Windows NT 3.5. Throughout its lifespan it was minimally updated, and is comparable to early versions of MacWrite. Early versions of Write only work with Write (.wri) files, but after Windows 3.0, Write became capable of reading and composing early Word (.doc) documents. With Windows 3.1, Write became OLE capable. In Windows 95, Write was replaced with WordPad.', NULL, NULL);
