The file format for the WP4.2 version contains only the document body with special function codes, and the format lacks a header or mandatory elements that can be used by
PRONOM for automatic identification. Each function code represents a text function, such as bold or underline, so with reference to the specification it should be possible to
parse the file to understand the intended layout. It may be the case that the file format for 4.0 and 4.1 is functionally identical or very similar to version 4.2.

A free C++ library called libwpd is available: http://libwpd.sourceforge.net/ and it includes the ability to parse WP4.2 files. This library is known to have been implemented
in LibreOffice, Koffice, and AbiWord among others, so these applications can be used to open and render WordPerfect 4.2 files, and potentially WP4.0 and WP4.1.

Due to the age of the format, WP4.x files may lack a format extension, however .wp4 and .wpd are known to be associated with the format.', NULL, NULL);

On the surface it''s a plain text file, however the format ''shifts'' the last byte of each word. Effectively it is ''flipping'' the first bit of the ASCII character from 0 to 1. so a lower case ''r'' (hex value 0x72) becomes ''ò'' (hex value 0xF2); lower case ''d'' (hex 0x64) becomes ''ä'' (hex 0xE4) and so on.

It should be possible to write a simple decoder application for WS4 files, however note that the conjecture above is based on observation of a limited pool of files, and there may be additional subtleties yet to be encountered and understood. Please contact the PRONOM team if you have any further information about this format.', NULL, NULL);















